(217, 'import_limit_reached_upgrade', '', 'You have reached your import limit, upgrade to pro to import unlimited videos!', 'لقد وصلت إلى حد الاستيراد، وترقية إلى الموالية لاستيراد أشرطة الفيديو غير محدود!', 'Du har nådd importgrensen din, oppgrader til pro for å importere ubegrensede videoer!', 'Vous avez atteint votre limite d\'importation, passez à pro pour importer des vidéos illimitées!', 'Sie haben Ihr Importlimit erreicht, aktualisieren Sie auf Pro, um unlimitierte Videos zu importieren!', 'Вы достигли своего лимита импорта, обновляете pro для импорта неограниченного количества видео!', '¡Has alcanzado tu límite de importación, actualízate a pro para importar videos ilimitados!', 'İçe aktarma limitinize ulaştınız, sınırsız videoları içe aktarmak için yanlızca yükseltin!', 'आप अपनी आयात सीमा तक पहुंच गए हैं, असीमित वीडियो आयात करने के लिए प्रो में अपग्रेड करें!', '您已达到导入限制，升级到 pro 以导入无限视频！', 'آپ اپنی درآمد کی حد تک پہنچ گئے ہیں، لامحدود ویڈیوز درآمد کرنے کے لیے پرو میں اپ گریڈ کریں!', 'Anda telah mencapai batas impor Anda, tingkatkan ke pro untuk mengimpor video tanpa batas!', 'Dosegli ste ograničenje uvoza, nadogradite na pro za uvoz neograničenog broja videozapisa!', 'הגעת למגבלת הייבוא שלך, שדרג למקצוען כדי לייבא סרטונים ללא הגבלה!', 'আপনি আপনার আমদানি সীমাতে পৌঁছেছেন, সীমাহীন ভিডিও আমদানি করতে প্রো-তে আপগ্রেড করুন!', 'インポート制限に達しました。プロにアップグレードして無制限のビデオをインポートしてください!', 'Você atingiu seu limite de importação, atualize para pro para importar vídeos ilimitados!', 'Hai raggiunto il limite di importazione, passa a pro per importare video illimitati!', 'شما به حد مجاز واردات خود رسیده اید، برای وارد کردن ویدیوهای نامحدود به حرفه ای ارتقا دهید!', 'Du har nått din importgräns, uppgradera till proffs för att importera obegränsade videor!', 'Bạn đã đạt đến giới hạn nhập của mình, hãy nâng cấp lên chuyên nghiệp để nhập video không giới hạn!', 'Du har nået din importgrænse, opgrader til pro for at importere ubegrænsede videoer!', 'Naabot mo na ang iyong limitasyon sa pag