(279, 'earn_mon', '', 'Earn ({{CONFIG pub_price}} {{CONFIG payment_currency}}) for each advertisement click you get from your videos!', 'اربح ({{CONFIG pub_price}} {{CONFIG payment_currency}}) لكل إعلان يتم النقر عليه من مقاطع الفيديو التابعة لك', 'Verdien ({{CONFIG pub_price}} {{CONFIG payment_currency}}) voor elke advertentieklik die je krijgt van je video\'s!', 'Gagnez ({{CONFIG pub_price}} {{CONFIG payment_currency}}) pour chaque annonce que vous recevez de vos vidéos!', 'Verdiene ({{CONFIG pub_price}} {{CONFIG payment_currency}}) für jeden Werbeclick, den du aus deinen Videos erhältst!', 'Заработайте ({{CONFIG pub_price}} {{CONFIG payment_currency}}) для каждого рекламного клика, который вы получаете от своих видео!', 'Gane ({{CONFIG pub_price}} {{CONFIG payment_currency}}) por cada clic publicitario que obtenga de sus videos.', 'Videolarınızdan aldığınız her bir reklam tıklaması için {{CONFIG pub_price}} {{CONFIG payment_currency}} kazanın!', 'अपने वीडियो से प्राप्त होने वाले प्रत्येक विज्ञापन क्लिक के लिए ({{CONFIG pub_price}} {{CONFIG payment_currency}}) कमाएं!', '您从视频中获得的每一次广告点击都能赚取 ({{CONFIG pub_price}} {{CONFIG payment_currency}})！', 'اپنے ویڈیوز سے حاصل ہونے والے ہر اشتہار پر کلک کے لیے ({{CONFIG pub_price}} {{CONFIG payment_currency}}) کمائیں!', 'Hasilkan ({{CONFIG pub_price}} {{CONFIG payment_currency}}) untuk setiap klik iklan yang Anda dapatkan dari video Anda!', 'Zaradite ({{CONFIG pub_price}} {{CONFIG payment_currency}}) za svaki klik na oglas koji dobijete od svojih videozapisa!', 'הרווח ({{CONFIG pub_price}} {{CONFIG payment_currency}}) עבור כל קליק על פרסומת שאתה מקבל מהסרטונים שלך!', 'প্রতিটি বিজ্ঞাপন ক্লিকের জন্য ({{CONFIG pub_price}} {{CONFIG payment_currency}}) উপার্জন করুন যা আপনি আপনার ভিডিও থেকে পান!', '動画から広告をクリックするたびに ({{CONFIG pub_price}} {{CONFIG payment_currency}}) を獲得できます!', 'Ganhe ({{CONFIG pub_price}} {{CONFIG payment_currency}}) por cada clique de anúncio que você receber de seus vídeos!', 'Guadagna ({{CONFIG pub_price}} {{CONFIG payment_currency}}) per ogni clic pubblicitario che ricevi dai tuoi video!', 'به ازای هر کلیک تبلیغاتی که از ویدیوهای خود دریافت می کنید، ({{CONFIG pub_price}} {{CONFIG payment_currency}}) کسب کنید!', 'Tjäna ({{CONFIG pub_price}} {{CONFIG payment_currency}}) för varje annonsklick du får från dina videor!', 'Kiếm tiền ({{CONFIG pub_price}} {{CONFIG Payment_currency}}) cho mỗi lần nhấp vào quảng cáo mà bạn nhận được từ video của mình!', 'Tjen ({{CONFIG pub_price}} {{CONFIG payment_currency}}) for hvert annonceklik, du får fra dine videoer!', 'Kumita ng ({{CONFIG pub_price}} {{CONFIG payment_currency}}) para sa bawat pag-click sa advertisement na makukuha mo mula sa iyong mga video!'),
