(287, 'submit_verif_request_error', '', 'You can not submit verification request until the previous requests has been accepted / rejected', 'لا يمكنك إرسال طلب التحقق إلى أن يتم قبول الطلبات السابقة أو رفضها', 'U kunt geen verificatieverzoek indienen totdat de vorige verzoeken zijn geaccepteerd / afgewezen', 'Vous ne pouvez pas soumettre de demande de vérification tant que les demandes précédentes n\'ont pas été acceptées / rejetées', 'Sie können keine Überprüfungsanfrage senden, bis die vorherigen Anforderungen akzeptiert / abgelehnt wurden.', 'Вы не можете отправить запрос на подтверждение до тех пор, пока предыдущие запросы не будут приняты / отклонены', 'No puede enviar solicitud de verificación hasta que las solicitudes anteriores hayan sido aceptadas / rechazadas', 'Önceki istekler kabul / reddedilene kadar doğrulama isteği gönderemezsiniz.', 'आप सत्यापन अनुरोध तब तक सबमिट नहीं कर सकते जब तक कि पिछले अनुरोध स्वीकार/अस्वीकार नहीं कर दिए जाते', '在之前的请求被接受/拒绝之前，您不能提交验证请求', 'آپ تصدیق کی درخواست اس وقت تک جمع نہیں کر سکتے جب تک کہ پچھلی درخواستوں کو قبول/مسترد نہ کر دیا جائے۔', 'Anda tidak dapat mengirimkan permintaan verifikasi sampai permintaan sebelumnya telah diterima/ditolak', 'Ne možete podnijeti zahtjev za verifikaciju dok prethodni zahtjevi ne budu prihvaćeni/odbačeni', 'אינך יכול להגיש בקשת אימות עד שהבקשות הקודמות יתקבלו / נדחו', 'পূর্ববর্তী অনুরোধগুলি গ্রহণ/প্রত্যাখ্যান না হওয়া পর্যন্ত আপনি যাচাইকরণের অনুরোধ জমা দিতে পারবেন না', '前のリクエストが承認または拒否されるまで、検証リクエストを送信できません', 'Você não pode enviar solicitação de verificação até que as solicitações anteriores tenham sido aceitas/rejeitadas', 'Non è possibile inviare la richiesta di verifica fino a quando le richieste precedenti non sono state accettate/rifiutate', 'تا زمانی که درخواست های قبلی پذیرفته یا رد نشده باشد، نمی توانید درخواست تأیید را ارسال کنید', 'Du kan inte skicka in verifieringsförfrågan förrän de tidigare förfrågningarna har accepterats/avvisats', 'Bạn không thể gửi yêu cầu xác minh cho đến khi c