(411, 'video_approve_text', '', 'This video is being reviewed, please check back later.', 'هذا الفيديو قيد المراجعة ، يرجى معاودة التحقق لاحقًا.', 'Deze video wordt beoordeeld. Kom later nog eens terug.', 'Cette vidéo est en cours de révision, veuillez vérifier plus tard.', 'Dieses Video wird gerade überprüft. Bitte schauen Sie später noch einmal vorbei.', 'Это видео просматривается, пожалуйста, зайдите позже.', 'Este video está siendo revisado, por favor revise más tarde.', 'Bu video inceleniyor, lütfen daha sonra tekrar kontrol edin.', 'इस वीडियो की समीक्षा की जा रही है, कृपया बाद में देखें।', '此视频正在审核中，请稍后再查看。', 'اس ویڈیو کا جائزہ لیا جا رہا ہے، براہ کرم بعد میں دوبارہ چیک کریں۔', 'Video ini sedang ditinjau, silakan periksa kembali nanti.', 'Ovaj se videozapis pregledava, provjerite kasnije.', 'סרטון זה נמצא בבדיקה, אנא בדוק שוב מאוחר יותר.', 'এই ভিডিওটি পর্যালোচনা করা হচ্ছে, অনুগ্রহ করে পরে আবার চেক করুন।', 'この動画は審査中です。後でもう一度確認してください。', 'Este vídeo está sendo revisado, verifique novamente mais tarde.', 'Questo video è in fase di revisione, per favore ricontrolla più tardi.', 'این ویدیو در حال بررسی است، لطفاً بعداً دوباره بررسی کنید.', 'Den här videon granskas, kom tillbaka senare.', 'Video này đang được xem xét, vui lòng kiểm tra lại sau.', 'Denne video er ved at blive gennemgået. Kom venligst tilbage senere.', 'Ang video na ito ay sinusuri, mangyaring bumalik sa ibang pagkakataon.'),
