(450, 'two_factor_description', 'Turn on 2-step login to level-up your account\'s security, Once turned on, you\'ll use both your passw', 'Turn on 2-step login to level-up your account\'s security, Once turned on, you\'ll use both your password and a 6-digit security code sent to your email to log in.', 'قم بتشغيل تسجيل الدخول المكوَّن من خطوتين لتحسين مستوى أمان حسابك ، وبمجرد تشغيله ، ستستخدم كل من كلمة المرور ورمز الحماية المكون من 6 أرقام والمرسلين إلى بريدك الإلكتروني لتسجيل الدخول.', 'Schakel login in 2 stappen in om de beveiliging van uw account te verbeteren. Als u eenmaal bent ingeschakeld, gebruikt u zowel uw wachtwoord als een uit 6 cijfers bestaande beveiligingscode die naar uw e-mailadres is gestuurd om u aan te melden.', 'Activez la connexion en deux étapes pour renforcer la sécurité de votre compte. Une fois activé, vous utiliserez votre mot de passe et un code de sécurité à 6 chiffres envoyé à votre adresse e-mail pour vous connecter.', 'Aktivieren Sie die Anmeldung in zwei Schritten, um die Sicherheit Ihres Kontos zu erhöhen. Nach dem Einschalten verwenden Sie sowohl Ihr Passwort als auch einen 6-stelligen Sicherheitscode, der an Ihre E-Mail gesendet wird, um sich anzumelden.', 'Включите двухэтапную регистрацию, чтобы повысить уровень безопасности своей учетной записи. После включения вы будете использовать для входа в свой пароль и 6-значный код безопасности, отправленный на вашу электронную почту.', 'Active el inicio de sesión en dos pasos para aumentar la seguridad de su cuenta. Una vez que lo haya activado, utilizará su contraseña y un código de seguridad de 6 dígitos enviado a su correo electrónico para iniciar sesión.', 'Hesabınızın güvenliğini artırmak için 2 adımlı giriş özelliğini açın. Açıldıktan sonra, giriş yapmak için e-postanıza gönderilen şifrenizi ve 6 basamaklı bir güvenlik kodunu kullanacaksınız.', 'अपने खाते की सुरक्षा को स्तर-अप करने के लिए 2-चरणीय लॉगिन चालू करें, एक बार चालू होने पर, आप लॉग इन करने के लिए अपने पासवर्ड और आपके ईमेल पर भेजे गए 6-अंकीय सुरक्षा कोड दोनों का उपयोग करेंगे।', '打开两步登录以提高您帐户的安全性，一旦打开，您将使用您的密码和发送到您的电子邮件的 6 位安全代码进行登录。', 'اپنے اکاؤنٹ کی سیکیورٹی کو بڑھانے کے لیے 2 قدمی لاگ ان کو آن کریں، ایک بار آن ہونے کے بعد، آپ لاگ ان کرنے کے لیے اپنے ای میل پر بھیجے گئے اپنا پاس ورڈ اور 6 ہندسوں کا سیکیورٹی کوڈ دونوں استعمال کریں گے۔', 'Aktifkan login 2 langkah untuk meningkatkan keamanan akun Anda, Setelah diaktifkan, Anda akan menggunakan kata sandi dan kode keamanan 6 digit yang dikirim ke email Anda untuk login.', 'Uključite prijavu u 2 koraka kako biste podigli razinu sigurnosti svog računa. Kada je uključite, za prijavu ćete koristiti i svoju lozinku i 6-znamenkasti sigurnosni kod poslan na vašu e-poštu.', 'הפעל התחברות דו-שלבית כדי לשפר את האבטחה של חשבונך, לאחר ההפעלה, תשתמש גם בסיסמה וגם בקוד אבטחה בן 6 ספרות שנשלח לדוא&quot;ל שלך כדי להיכנס.', 'আপনার অ্যাকাউন্টের নিরাপত্তার স্তর বাড়াতে 2-পদক্ষেপ লগইন চালু করুন, একবার চালু হলে, আপনি লগ ইন করতে আপনার ইমেলে পাঠানো আপনার পাসওয়ার্ড এবং একটি 6-সংখ্যার নিরাপত্তা কোড উভয়ই ব্যবহার করবেন৷', '2 段階ログインを有効にして、アカウントのセキュリティをレベルアップします。有効にすると、パスワードとメールに送信された 6 桁のセキュリティ コードの両方を使用してログインします。', 'Ative o login em duas etapas para aumentar a segurança da sua conta. Uma vez ativado, você usará sua senha e um código de segurança de 6 dígitos enviado ao seu e-mail para fazer login.', 'Attiva l&#39;accesso in 2 passaggi per aumentare di livello la sicurezza del tuo account. Una volta attivato, utilizzerai sia la tua password che un codice di sicurezza a 6 cifre inviato alla tua email per accedere.', 'برای ارتقای امنیت حساب خود، ورود دو مرحله‌ای را روشن کنید، پس از روشن شدن، هم از رمز عبور و هم از یک کد امنیتی 6 رقمی که به ایمیلتان ارسال می‌شود برای ورود استفاده می‌کنید.', 'Aktivera 2-stegsinloggning för att höja säkerheten på ditt konto. När du har aktiverat det använder du både ditt lösenord och en 6-siffrig säkerhetskod som skickas till din e-post för att logga in.', 'Bật đăng nhập 2 bước để tăng cường bảo mật cho tài khoản của bạn, Sau khi được bật, bạn sẽ sử dụng cả mật khẩu và mã bảo mật 6 chữ số được gửi đến email của bạn để đăng nhập.', 'Slå 2-trins login til for at øge din kontos sikkerhed. Når den er aktiveret, bruger du både din adgangskode og en 6-cifret sikkerhedskode sendt til din e-mail for at logge ind.', 'I-on ang 2-step na pag-log in upang i-level-up ang seguridad ng iyong account, Kapag na-on, gagamitin mo pareho ang iyong password at isang 6-digit na security code na ipinadala sa iyong email upang mag-log in.'),
