(484, 'this_video_queue', 'This video is being added to queue, please check back in few minutes.', 'This video is being added to queue, please check back in few minutes.', 'تتم إضافة هذا الفيديو إلى قائمة الانتظار ، يرجى التحقق مرة أخرى في غضون بضع دقائق.', 'Deze video wordt aan de wachtrij toegevoegd. Probeer het over enkele minuten opnieuw.', 'Cette vidéo est en train d\'être ajoutée à la file d\'attente. Veuillez vérifier à nouveau dans quelques minutes.', 'Dieses Video wird zur Warteschlange hinzugefügt. Bitte versuchen Sie es in wenigen Minuten noch einmal.', 'Это видео добавляется в очередь, пожалуйста, зайдите через несколько минут.', 'Este video se está agregando a la cola, por favor revise de nuevo en unos minutos.', 'Bu video kuyruğa ekleniyor, lütfen birkaç dakika içinde tekrar kontrol edin.', 'यह वीडियो कतार में जोड़ा जा रहा है, कृपया कुछ मिनटों में वापस देखें।', '此视频正在添加到队列中，请过几分钟再回来查看。', 'اس ویڈیو کو قطار میں شامل کیا جا رہا ہے، براہ کرم چند منٹوں میں دوبارہ چیک کریں۔', 'Video ini sedang ditambahkan ke antrean, harap periksa kembali dalam beberapa menit.', 'Ovaj se videozapis dodaje u red čekanja, provjerite ponovno za nekoliko minuta.', 'סרטון זה מתווסף לתור, אנא בדוק שוב בעוד מספר דקות.', 'এই ভিডিওটি সারিতে যোগ করা হচ্ছে, অনুগ্রহ করে কয়েক মিনিটের মধ্যে আবার চেক করুন৷', 'このビデオはキューに追加されています。数分後にもう一度確認してください。', 'Este vídeo está sendo adicionado à fila, verifique novamente em alguns minutos.', 'Questo video è stato aggiunto alla coda, per favore ricontrolla tra qualche minuto.', 'این ویدیو در حال اضافه شدن به صف است، لطفاً چند دقیقه دیگر دوباره بررسی کنید.', 'Den här videon läggs till i kön, kom tillbaka om några minuter.', 'Video này đang được thêm vào hàng đợi, vui lòng kiểm tra lại sau vài phút.', 'Denne video føjes til køen, tjek venligst tilbage om et par minutter.', 'Ang video na ito ay idinaragdag sa queue, mangyaring bumalik sa loob ng ilang minuto.'),
