(495, 'video_not_available_location', 'This video is not available in your location.', 'This video is not available in your location.', 'هذا الفيديو غير متوفر في موقعك.', 'Deze video is niet beschikbaar op jouw locatie.', 'Cette vidéo n\'est pas disponible dans votre région.', 'Dieses Video ist an Ihrem Standort nicht verfügbar.', 'Это видео недоступно в вашем регионе.', 'Este video no está disponible en tu ubicación.', 'Bu video bulunduğunuz yerde mevcut değil.', 'यह वीडियो आपके स्थान पर उपलब्ध नहीं है।', '此视频在您所在的位置不可用。', 'یہ ویڈیو آپ کے مقام پر دستیاب نہیں ہے۔', 'Video ini tidak tersedia di lokasi Anda.', 'Ovaj video nije dostupan na vašoj lokaciji.', 'סרטון זה אינו זמין במיקומך.', 'এই ভিডিওটি আপনার অবস্থানে উপলব্ধ নয়৷', 'このビデオは、お住まいの地域ではご利用いただけません。', 'Este vídeo não está disponível em seu local.', 'Questo video non è disponibile nella tua località.', 'این ویدیو در مکان شما موجود نیست.', 'Den här videon är inte tillgänglig på din plats.', 'Video này không có sẵn ở địa điểm của bạn.', 'Denne video er ikke tilgængelig på din placering.', 'Hindi available ang video na ito sa iyong lokasyon.'),
(496, 'geo_blocking', 'Geo Blocking', 'Geo-Blocking', 'الحظر الجغرافي', 'Geo-blokkering', 'Géolocalisation', 'Geo-Blockierung', 'Геоблокировка', 'Bloqueo geográfico', 'Coğrafi engelleme', 'भू-अवरुद्ध', '地理封锁', 'جیو بلاک کرنا', 'Pemblokiran Geografis', 'Geo-blokiranje', 'חסימה גיאוגרפית', 'জিও-ব্লকিং', 'ジオブロッキング', 'Bloqueio geográfico', 'Geo-Blocco', 'Geo-Blocking', 'Geo-blockering', 'Chặn địa lý', 'Geo-blokering', 'Geo-Blocking'),
(497, 'unknown_location', 'Your location is unknown, therefore this video was blocked.\\r\\nYou may try again later.', 'Your location is unknown, therefore this video was blocked.\\r\\nYou may try again later.', 'موقعك غير معروف ، لذا تم حظر هذا الفيديو.يجوز لك إعادة المحاولة لاحقًا.', 'Uw locatie is onbekend, dus deze video is geblokkeerd. kunt het later opnieuw proberen.', 'Votre position est inconnue, cette vidéo a donc été bloquée. Vous pouvez réessayer plus tard.', 'Ihr Standort ist unbekannt, daher wurde dieses Video gesperrt. Sie können es später erneut versuchen.', 'Ваше местоположение неизвестно, поэтому это видео было заблокировано. Вы можете попробовать позже.', 'Su ubicación es desconocida, por lo que este video fue bloqueado. Puedes intentarlo más tarde.', 'Konumunuz bilinmiyor, bu nedenle bu video engellendi. Daha sonra tekrar deneyebilirsiniz.', 'आपका स्थान अज्ञात है, इसलिए इस वीडियो को अवरुद्ध कर दिया गया था।\\r\\nआप बाद में पुन: प्रयास कर सकते हैं।', '您的位置未知，因此该视频已被阻止。\\r\\n您可以稍后再试。', 'آپ کا مقام نامعلوم ہے، اس لیے یہ ویڈیو بلاک کر دی گئی تھی۔\\r\\nآپ بعد میں دوبارہ کوشش کر سکتے ہیں۔', 'Lokasi Anda tidak diketahui, oleh karena itu video ini diblokir.\\r\\nAnda dapat mencoba lagi nanti.', 'Vaša lokacija je nepoznata, stoga je ovaj video blokiran.\\r\\nMožete pokušati ponovo kasnije.', 'המיקום שלך לא ידוע, לכן הסרטון הזה נחסם.\\r\\nתוכל לנסות שוב מאוחר יותר.', 'আপনার অবস্থান অজানা, তাই এই ভিডিওটি ব্লক করা হয়েছে৷\\r\\nআপনি পরে আবার চেষ্টা করতে পারেন৷', 'あなたの居場所が不明なため、このビデオはブロックされました。\\r\\n後でもう一度試してください。', 'Sua localização é desconhecida, portanto, este vídeo foi bloqueado.\\r\\nTente novamente mais tarde.', 'La tua posizione è sconosciuta, quindi questo video è stato bloccato.\\r\\nPuoi riprovare più tardi.', 'مکان شما ناشناخته است، بنابراین این ویدیو مسدود شده است.\\r\\nشما می توانید بعداً دوباره امتحان کنید.', 'Din plats är okänd, därför blockerades den här videon.\\r\\nDu kan försöka igen senare.', 'Vị trí của bạn không xác định, do đó video này đã bị chặn. \\ R \\ nBạn có thể thử lại sau.', 'Din placering er ukendt, derfor blev denne video blokeret.\\r\\nDu kan prøve igen senere.', 'Hindi alam ang iyong lokasyon, kaya na-block ang video na ito.\\r\\nMaaari mong subukang muli sa ibang pagkakataon.'),
