(523, 'image_not_valid', '', 'The Image file is not valid, please select a valid image.', 'ملف الصورة غير صالح ، يرجى تحديد صورة صالحة.', 'Het beeldbestand is niet geldig, selecteer een geldige afbeelding.', 'Le fichier image n\'est pas valide, veuillez sélectionner une image valide.', 'Die Bilddatei ist nicht gültig. Bitte wählen Sie ein gültiges Bild aus.', 'Файл изображения недействителен, пожалуйста, выберите правильное изображение.', 'El archivo de imagen no es válido, seleccione una imagen válida.', 'Resim dosyası geçerli değil, lütfen geçerli bir resim seçin.', 'छवि फ़ाइल मान्य नहीं है, कृपया एक मान्य छवि चुनें।', '图片文件无效，请选择有效图片。', 'تصویری فائل درست نہیں ہے، براہ کرم ایک درست تصویر منتخب کریں۔', 'File gambar tidak valid, pilih gambar yang valid.', 'Datoteka slike nije valjana, odaberite valjanu sliku.', 'קובץ התמונה אינו חוקי, אנא בחר תמונה חוקית.', 'চিত্র ফাইলটি বৈধ নয়, দয়া করে একটি বৈধ চিত্র নির্বাচন করুন৷', '画像ファイルが無効です。有効な画像を選択してください。', 'O arquivo de imagem não é válido, selecione uma imagem válida.', 'Il file immagine non è valido, seleziona un&#39;immagine valida.', 'فایل تصویر معتبر نیست، لطفا یک تصویر معتبر انتخاب کنید.', 'Bildfilen är inte giltig, välj en giltig bild.', 'Tệp Hình ảnh không hợp lệ, vui lòng chọn một hình ảnh hợp lệ.', 'Billedfilen er ikke gyldig, vælg venligst et gyldigt billede.', 'Ang file ng Imahe ay hindi wasto, mangyaring pumili ng wastong larawan.'),
(524, 'category_not_valid', '', 'Invalid category, Please check your details.', 'فئة غير صالحة ، يرجى التحقق من التفاصيل الخاصة بك.', 'Ongeldige categorie, controleer uw gegevens.', 'Catégorie non valide, veuillez vérifier vos coordonnées.', 'Ungültige Kategorie. Bitte überprüfen Sie Ihre Angaben.', 'Неверная категория, пожалуйста, проверьте ваши данные.', 'Categoría no válida, por favor revise sus detalles.', 'Geçersiz kategori, Lütfen bilgilerinizi kontrol ediniz.', 'अमान्य श्रेणी, कृपया अपना विवरण जांचें।', '类别无效，请检查您的详细信息。', 'غلط زمرہ، براہ کرم اپنی تفصیلات چیک کریں۔', 'Kategori tidak valid, Harap periksa detail Anda.', 'Nevažeća kategorija, provjerite svoje podatke.', 'קטגוריה לא חוקית, אנא בדוק את הפרטים שלך.', 'অবৈধ বিভাগ, আপনার বিবরণ চেক করুন.', '無効なカテゴリです。詳細を確認してください。', 'Categoria inválida, verifique seus dados.', 'Categoria non valida, controlla i tuoi dati.', 'دسته بندی نامعتبر است، لطفاً جزئیات خود را بررسی کنید.', 'Ogiltig kategori. Kontrollera dina uppgifter.', 'Danh mục không hợp lệ, Vui lòng kiểm tra chi tiết của bạn.', 'Ugyldig kategori. Tjek venligst dine oplysninger.', 'Di-wastong kategorya, Pakisuri ang iyong mga detalye.'),
(525, 'reviewed_article', '', 'Thank you, your article has been submitted, and it\'s being reviewed, please check back later.', 'شكرًا ، تم إرسال مقالك ، وهو قيد المراجعة ، يرجى التحقق مرة أخرى لاحقًا.', 'Bedankt, uw artikel is verzonden en het wordt beoordeeld. Kom later nog eens terug.', 'Merci, votre article a été soumis et il est en train d\'être revu, revenez plus tard.', 'Vielen Dank, Ihr Artikel wurde eingereicht, und er wird überprüft. Bitte versuchen Sie es später erneut.', 'Спасибо, ваша статья была отправлена, и она проверяется, пожалуйста, зайдите позже.', 'Gracias, su artículo fue enviado y está siendo revisado, por favor, vuelva más tarde.', 'Teşekkürler, makaleniz gönderildi ve inceleniyor, lütfen daha sonra tekrar kontrol edin.', 'धन्यवाद, आपका लेख सबमिट कर दिया गया है, और इसकी समीक्षा की जा रही है, कृपया बाद में देखें।', '谢谢，您的文章已提交，正在审核中，请稍后再查看。', 'آپ کا شکریہ، آپ کا مضمون جمع کر دیا گیا ہے، اور اس کا جائزہ لیا جا رہا ہے، براہ کرم بعد میں دوبارہ چیک کریں۔', 'Terima kasih, artikel Anda telah terkirim, dan sedang ditinjau, silakan periksa kembali nanti.', 'Hvala vam, vaš je članak poslan i na recenziji je, provjerite kasnije.', 'תודה, המאמר שלך נשלח והוא בבדיקה, אנא בדוק שוב מאוחר יותר.', 'ধন্যবাদ, আপনার নিবন্ধ জমা দেওয়া হয়েছে, এবং এটি পর্যালোচনা করা হচ্ছে, অনুগ্রহ করে পরে আবার চেক করুন।', 'ありがとうございます。記事が送信され、審査中です。後でもう一度確認してください。', 'Obrigado, seu artigo foi enviado e está sendo revisado. Verifique novamente mais tarde.', 'Grazie, il tuo articolo è stato inviato ed è in fase di revisione, per favore ricontrolla più tardi.', 'با تشکر از شما، مقاله شما ارسال شده است، و در حال بررسی است، لطفاً بعداً بررسی کنید.', 'Tack, din artikel har skickats och den håller på att granskas. Kom tillbaka senare.', 'Cảm ơn bạn, bài viết của bạn đã được gửi và đang được xem xét, vui lòng kiểm tra lại sau.', 'Tak, din artikel er blevet indsendt, og den er ved at blive gennemgået. Kom venligst tilbage senere.', 'Salamat, naisumite na ang iyong artikulo, at sinusuri ito, 