(546, 'rent_video', '', 'Rent this movie', 'استئجار هذا الفيلم', 'Huur deze film', 'Louez ce film', 'Mieten Sie diesen Film', 'Прокат этого фильма', 'Alquilar esta pelicula', 'Bu filmi kirala', 'इस फिल्म को किराए पर लें', '租这部电影', 'اس فلم کو کرایہ پر لیں۔', 'Sewa film ini', 'Posudite ovaj film', 'השכרת את הסרט הזה', 'এই সিনেমা ভাড়া', 'この映画をレンタルする', 'Alugue este filme', 'Noleggia questo film', 'این فیلم را اجاره کنید', 'Hyr den här filmen', 'Thuê phim này', 'Lej denne film', 'Rentahan ang pelikulang ito'),
(547, 'cover_size', '', 'For movies, the cover size should not be more than 400x570.', 'بالنسبة للأفلام ، يجب ألا يزيد حجم الغطاء عن 400 × 570.', 'Voor films mag de omslag niet groter zijn dan 400x570.', 'Pour les films, la taille de la couverture ne doit pas dépasser 400x570.', 'Bei Filmen sollte die Covergröße nicht größer als 400 x 570 sein.', 'Для фильмов размер обложки не должен превышать 400х570.', 'Para películas, el tamaño de la cubierta no debe ser más de 400x570.', 'Filmler için kapak boyutu 400x570\'den fazla olmamalıdır.', 'फिल्मों के लिए, कवर का आकार 400x570 से अधिक नहीं होना चाहिए।', '对于电影，封面尺寸不应超过 400x570。', 'فلموں کے لیے، کور کا سائز 400x570 سے زیادہ نہیں ہونا چاہیے۔', 'Untuk film, ukuran sampul tidak boleh lebih dari 400x570.', 'Za filmove, veličina omota ne smije biti veća od 400x570.', 'עבור סרטים, גודל הכריכה לא צריך להיות יותר מ-400x570.', 'চলচ্চিত্রের জন্য, কভারের আকার 400x570 এর বেশি হওয়া উচিত নয়।', '映画の場合、表紙のサイズは 400x570 を超えないようにしてください。', 'Para filmes, o tamanho da capa não deve ser superior a 400x570.', 'Per i film, la dimensione della copertina non deve essere superiore a 400x570.', 'برای فیلم ها، اندازه جلد نباید بیشتر از 400x570 باشد.', 'För filmer bör omslagsstorleken inte vara mer än 400x570.', 'Đối với phim, kích thước bìa không được quá 400x570.', 'For film bør coverstørrelsen ikke være mere end 400x570.', 'Para sa mga pelikula, ang laki ng pabalat ay hindi dapat higit sa 400x570.'),
(548, 'movies_text', '', 'To watch this movie, you have to purchase it.', 'لمشاهدة هذا الفيلم ، عليك شراءه.', 'Om deze film te bekijken, moet je hem kopen.', 'Pour regarder ce film, vous devez l\'acheter.', 'Um diesen Film anzusehen, müssen Sie ihn kaufen.', 'Чтобы посмотреть этот фильм, вы должны приобрести его.', 'Para ver esta película, tienes que comprarla.', 'Bu filmi izlemek için satın almanız gerekir.', 'इस फिल्म को देखने के लिए आपको इसे खरीदना होगा।', '要观看这部电影，您必须购买它。', 'اس فلم کو دیکھنے کے لیے، آپ کو اسے خریدنا ہوگا۔', 'Untuk menonton film ini, Anda harus membelinya.', 'Da biste pogledali ovaj film, morate ga kupiti.', 'כדי לצפות בסרט הזה, אתה צריך לרכוש אותו.', 'এই সিনেমা দেখতে, আপনি এটি কিনতে হবে.', 'この映画を見るには、購入する必要があります。', 'Para assistir a este filme, você tem que comprá-lo.', 'Per vedere questo film, devi acquistarlo.', 'برای تماشای این فیلم باید آن را خریداری کنید.', 'För att se den här filmen måste du köpa den.', 'Để xem phim này, bạn phải mua nó.', 'For at se denne film skal du købe den.', 'Upang mapanood ang pelikulang ito, kailangan mong bilhin ito.'),
(549, 'transfer_earnings', '', 'Transfer earnings to wallet', 'تحويل الأرباح إلى المحفظة', 'Overdracht van inkomsten naar portemonnee', 'Transférer les revenus dans un portefeuille', 'Übertragen Sie die Einnahmen in die Brieftasche', 'Перевести заработок на кошелек', 'Transferencia de ganancias a la billetera', 'Kazançları cüzdanınıza aktarın', 'कमाई को वॉलेट में ट्रांसफर करें', '将收益转入钱包', 'کمائی کو بٹوے میں منتقل کریں۔', 'Transfer penghasilan ke dompet', 'Prijenos zarade u novčanik', 'העברת רווחים לארנק', 'ওয়ালেটে উপার্জন স্থানান্তর করুন', '収益をウォレットに転送する', 'Transferir ganhos para a carteira', 'Trasferisci i guadagni sul portafoglio', 'انتقال درآمد به کیف پول', 'Överför intäkter till plånbok', 'Chuyển thu nhập vào ví', 'Overfør indtjening til tegnebogen', 'Ilipat ang mga kita sa wallet'),
(550, 'transfer_money', '', 'Transfer money to wallet, so you would be able to use them for ads.', 'قم بتحويل الأموال إلى المحفظة ، حتى تتمكن من استخدامها للإعلانات.', 'Geld overboeken naar de portemonnee, zodat u ze voor advertenties kunt gebruiken.', 'Transférez de l\'argent dans un portefeuille afin que vous puissiez les utiliser pour des publicités.', 'Überweisen Sie Geld in die Brieftasche, damit Sie sie für Anzeigen verwenden können.', 'Переведите деньги на кошелек, чтобы вы могли использовать их для рекламы.', 'Transfiera dinero a la billetera, para que pueda utilizarlos para anuncios.', 'M-cüzdanınıza para aktarın, böylece reklamlar için kullanabilirsiniz.', 'वॉलेट में पैसे ट्रांसफर करें, ताकि आप उन्हें विज्ञापनों के लिए इस्तेमाल कर सकें।', '将钱转入钱包，这样您就可以将它们用于广告。', 'بٹوے میں رقم منتقل کریں، تاکہ آپ انہیں اشتہارات کے لیے استعمال کر سکیں۔', 'Transfer uang ke dompet, sehingga Anda dapat menggunakannya untuk iklan.', 'Prebacite novac u novčanik kako biste ih mogli koristiti za reklame.', 'העבר כסף לארנק, כדי שתוכל להשתמש בהם לפרסומות.', 'ওয়ালেটে অর্থ স্থানান্তর করুন, যাতে আপনি বিজ্ঞাপনের জন্য সেগুলি ব্যবহার করতে সক্ষম হবেন।', 'ウォレットにお金を転送して、広告に使用できるようにします。', 'Transfira dinheiro para a carteira, para que você possa usá-los para anúncios.', 'Trasferisci denaro sul portafoglio, in modo da poterli utilizzare per gli annunci.', 'پول را به کیف پول منتقل کنید تا بتوانید از آنها برای تبلیغات استفاده کنید.', 'Överför pengar till plånboken så att du kan använda dem för annonser.', 'Chuyển tiền vào ví để bạn có thể sử dụng chúng cho các quảng cáo.', 'Overfør penge til wallet, så du ville være i stand til at bruge dem til annoncer.', 'Maglipat ng pera sa wallet, para magamit mo ang mga ito para sa mga ad.'),
(551, 'withdrawal_earnings', '', 'Once the amount is transferred, you won\'t be able to withdrawal them.', 'بمجرد تحويل المبلغ ، لن تتمكن من سحبه.', 'Zodra het bedrag is overgemaakt, kunt u ze niet meer opnemen.', 'Une fois le montant transféré, vous ne pourrez plus les retirer.', 'Sobald der Betrag überwiesen ist, können Sie ihn nicht mehr abheben.', 'Как только сумма переведена, вы не сможете ее снять.', 'Una vez que la cantidad se transfiere, no podrá retirarlas.', 'Tutar bir kez transfer edildiğinde, onları çekemezsiniz.', 'एक बार राशि ट्रांसफर हो जाने के बाद, आप उन्हें वापस नहीं ले पाएंगे।', '一旦金额转移，您将无法提取它们。', 'رقم کی منتقلی کے بعد، آپ انہیں واپس نہیں لے سکیں گے۔', 'Setelah jumlah tersebut ditransfer, Anda tidak akan dapat menariknya.', 'Nakon što se iznos prenese, nećete ga moći podići.', 'לאחר העברת הסכום, לא תוכל למשוך אותם.', 'একবার পরিমাণ স্থানান্তর করা হলে, আপনি সেগুলি তুলতে পারবেন না।', '金額が転送されると、それらを引き出すことはできません。', 'Uma vez que o valor é transferido, você não poderá retirá-los.', 'Una volta trasferito l&#39;importo, non potrai prelevarli.', 'پس از انتقال مبلغ، نمی توانید آنها را برداشت کنید.', 'När beloppet väl har överförts kommer du inte att kunna ta ut det.', 'Sau khi số tiền được chuyển, bạn sẽ không thể rút chúng.', 'Når beløbet er overført, vil du ikke kunne hæve dem.', 'Kapag nailipat na ang halaga, hindi mo na sila ma-withdraw.'),
