(559, 'pay_to_see_video', '', 'More to watch! to continue watching this video, you have to purchase it.', 'أكثر لمشاهدة! لمتابعة مشاهدة هذا الفيديو ، عليك شراءه.', 'Meer om te zien! om deze video te blijven bekijken, moet je hem kopen.', 'Plus à regarder! pour continuer à regarder cette vidéo, vous devez l\'acheter.', 'Mehr zu sehen! Um dieses Video weiter anzusehen, müssen Sie es kaufen.', 'Больше смотреть! Чтобы продолжить просмотр этого видео, вы должны приобрести его.', '¡Más para ver! Para seguir viendo este video, debes comprarlo.', 'İzlemek için daha fazlası! Bu videoyu izlemeye devam etmek için satın almalısınız.', 'देखने के लिए और अधिक! इस वीडियो को देखना जारी रखने के लिए, आपको इसे खरीदना होगा।', '更多观看！要继续观看此视频，您必须购买它。', 'دیکھنے کے لیے مزید! اس ویڈیو کو دیکھنا جاری رکھنے کے لیے، آپ کو اسے خریدنا ہوگا۔', 'Lebih banyak untuk menonton! untuk terus menonton video ini, Anda harus membelinya.', 'Još za gledanje! da biste nastavili gledati ovaj video, morate ga kupiti.', 'עוד לצפייה! כדי להמשיך לצפות בסרטון זה, עליך לרכוש אותו.', 'আরো দেখার জন্য! এই ভিডিওটি দেখা চালিয়ে যেতে, আপনাকে এটি কিনতে হবে।', 'もっと見る！このビデオを引き続き視聴するには、購入する必要があります。', 'Mais para assistir! para continuar assistindo este vídeo, você precisa comprá-lo.', 'Altro da guardare! per continuare a guardare questo video, devi acquistarlo.', 'بیشتر برای تماشا! برای ادامه تماشای این ویدیو، باید آن را خریداری کنید.', 'Mer att titta på! för att fortsätta titta på den här videon måste du köpa den.', 'Thêm để xem! để tiếp tục xem video này, bạn phải mua nó.', 'Mere at se! for at fortsætte med at se denne video, skal du købe den.', 'Marami pang dapat panoorin! upang patuloy na mapanood ang video na ito, kailangan mong bilhin ito.'),
