(561, 'email_provider_banned', '', 'The email provider is blacklisted and not allowed, please choose another email provider.', 'مزود البريد الإلكتروني مدرج في القائمة السوداء وغير مسموح به ، يرجى اختيار مزود بريد إلكتروني آخر.', 'De e-mailprovider staat op de zwarte lijst en is niet toegestaan, kies een andere e-mailprovider.', 'Le fournisseur de messagerie est sur la liste noire et non autorisé. Veuillez choisir un autre fournisseur de messagerie.', 'Der E-Mail-Anbieter ist auf der schwarzen Liste und nicht zulässig. Bitte wählen Sie einen anderen E-Mail-Anbieter.', 'Поставщик электронной почты находится в черном списке и не допускается, выберите другого поставщика электронной почты.', 'El proveedor de correo electrónico está en la lista negra y no está permitido, elija otro proveedor de correo electrónico.', 'E-posta sağlayıcı kara listeye alındı ve izin verilmedi, lütfen başka bir e-posta sağlayıcısı seçin.', 'ईमेल प्रदाता को काली सूची में डाल दिया गया है और अनुमति नहीं है, कृपया कोई अन्य ईमेल प्रदाता चुनें।', '电子邮件提供商被列入黑名单且不允许，请选择其他电子邮件提供商。', 'ای میل فراہم کنندہ بلیک لسٹ میں ہے اور اس کی اجازت نہیں ہے، براہ کرم کوئی دوسرا ای میل فراہم کنندہ منتخب کریں۔', 'Penyedia email masuk daftar hitam dan tidak diizinkan, silakan pilih penyedia email lain.', 'Davatelj usluga e-pošte je na crnoj listi i nije dopušten, odaberite drugog pružatelja usluga e-pošte.', 'ספק הדוא&quot;ל נמצא ברשימה השחורה ואינו מותר, אנא בחר ספק דוא&quot;ל אחר.', 'ইমেল প্রদানকারী কালো তালিকাভুক্ত এবং অনুমোদিত নয়, অনুগ্রহ করে অন্য একটি ইমেল প্রদানকারী বেছে নিন।', 'メール プロバイダーはブラックリストに登録されており、許可されていません。別のメール プロバイダーを選択してください。', 'O provedor de e-mail está na lista negra e não é permitido. Escolha outro provedor de e-mail.', 'Il provider di posta elettronica è nella lista nera e non è consentito, scegli un altro provider di posta elettronica.', 'ارائه دهنده ایمیل در لیست سیاه قرار دارد و مجاز نیست، لطفا ارائه دهنده ایمیل دیگری را انتخاب کنید.', 'E-postleverantören är svartlistad och inte tillåten, välj en annan e-postleverantör.', 'Nhà cung cấp email nằm trong danh sách đen và không được phép, vui lòng chọn nhà cung cấp email khác.', 'E-mail-udbyderen er sortlistet og ikke tilladt, vælg venligst en anden e-mail-udbyder.', 'Ang email provider ay naka-blacklist at hindi pinapayagan, mangyaring pumili ng ibang email provider.'),
(562, 'age_block_text', '', 'You are under 18 you can\'t access this site for {hour} hour(s).', 'أنت أقل من 18 عامًا ولا يمكنك الوصول إلى هذا الموقع لمدة {ساعة} (ساعات).', 'U bent jonger dan 18 jaar, u hebt gedurende {uur} uur (uren) geen toegang tot deze site.', 'Vous avez moins de 18 ans, vous ne pouvez pas accéder à ce site pendant {heure} heure (s).', 'Sie sind jünger als 18 Jahre und können für {hour} hour (s) nicht auf diese Site zugreifen.', 'Вам не исполнилось 18 лет, и вы не можете получить доступ к этому сайту в течение {часов} часов.', 'Tiene menos de 18 años, no puede acceder a este sitio durante {hora} hora (s).', '18 yaşından küçüksünüz, bu siteye {hour} saat boyunca erişemezsiniz.', 'आपकी आयु 18 वर्ष से कम है आप इस साइट को {hour} घंटे तक एक्सेस नहीं कर सकते।', '您未满 18 岁，您在 {hour} 小时内无法访问此网站。', 'آپ کی عمر 18 سال سے کم ہے آپ اس سائٹ تک {hour} گھنٹے تک رسائی حاصل نہیں کر سکتے۔', 'Anda berusia di bawah 18 tahun, Anda tidak dapat mengakses situs ini selama {hour} jam.', 'Imate manje od 18 godina i ne možete pristupiti ovoj stranici {hour} sat(ova).', 'אתה מתחת לגיל 18, אינך יכול לגשת לאתר זה במשך {hour} שעות.', 'আপনি 18 বছরের কম বয়সী আপনি এই সাইটে {ঘন্টা} ঘণ্টার জন্য অ্যাক্সেস করতে পারবেন না।', 'あなたは 18 歳未満で、このサイトに {hour} 時間アクセスできません。', 'Você tem menos de 18 anos, não pode acessar este site por {hour} hora(s).', 'Hai meno di 18 anni non puoi accedere a questo sito per {hour} ora/e.', 'شما کمتر از 18 سال دارید و نمی توانید به مدت {hour} ساعت به این سایت دسترسی داشته باشید.', 'Du är under 18 år och du kan inte komma åt den här webbplatsen på {hour} timme(r).', 'Bạn dưới 18 tuổi, bạn không thể truy cập trang web này trong {giờ} giờ.', 'Du er under 18, du kan ikke få adgang til dette websted i {hour} time(r).', 'Wala ka pang 18 taong gulang hindi mo maa-access ang site na ito sa loob ng {hour} (mga) oras.'),
