(582, 'checkout_declined', '', 'Your payment was declined, please contact your bank or card issuer and make sure you have the required funds.', 'تم رفض دفعتك ، يرجى الاتصال بالمصرف أو مصدر البطاقة والتأكد من أن لديك الأموال المطلوبة.', 'Uw betaling is geweigerd. Neem contact op met uw bank of creditcardmaatschappij en zorg dat u over het benodigde geld beschikt.', 'Votre paiement a été refusé, veuillez contacter votre banque ou votre émetteur de carte et assurez-vous de disposer des fonds nécessaires.', 'Ihre Zahlung wurde abgelehnt. Wenden Sie sich an Ihre Bank oder Ihren Kartenaussteller, und vergewissern Sie sich, dass Sie über das erforderliche Guthaben verfügen.', 'Ваш платеж был отклонен, пожалуйста, свяжитесь с банком или эмитентом карты и убедитесь, что у вас есть необходимые средства.', 'Su pago fue rechazado, póngase en contacto con su banco o con el emisor de la tarjeta y asegúrese de tener los fondos necesarios.', 'Ödemeniz reddedildi, lütfen bankanıza veya kart düzenleyicinize başvurun ve gerekli paranın olduğundan emin olun.', 'आपका भुगतान अस्वीकार कर दिया गया था, कृपया अपने बैंक या कार्ड जारीकर्ता से संपर्क करें और सुनिश्चित करें कि आपके पास आवश्यक धनराशि है।', '您的付款被拒绝，请联系您的银行或发卡机构并确保您有所需的资金。', 'آپ کی ادائیگی مسترد کر دی گئی، براہ کرم اپنے بینک یا کارڈ جاری کنندہ سے رابطہ کریں اور یقینی بنائیں کہ آپ کے پاس مطلوبہ فنڈز ہیں۔', 'Pembayaran Anda ditolak, harap hubungi bank atau penerbit kartu Anda dan pastikan Anda memiliki dana yang diperlukan.', 'Vaše je plaćanje odbijeno, obratite se svojoj banci ili izdavatelju kartice i provjerite imate li potrebna sredstva.', 'התשלום שלך נדחה, צור קשר עם הבנק או מנפיק הכרטיס שלך וודא שיש לך את הכספים הנדרשים.', 'আপনার অর্থপ্রদান প্রত্যাখ্যান করা হয়েছে, অনুগ্রহ করে আপনার ব্যাঙ্ক বা কার্ড প্রদানকারীর সাথে যোগাযোগ করুন এবং নিশ্চিত করুন যে আপনার কাছে প্রয়োজনীয় তহবিল আছে৷', '支払いが拒否されました。銀行またはカード発行会社に連絡し、必要な資金があることを確認してください。', 'Seu pagamento foi recusado. Entre em contato com seu banco ou emissor do cartão e verifique se você tem os fundos necessários.', 'Il pagamento è stato rifiutato, contatta la banca o l&#39;emittente della carta e assicurati di disporre dei fondi necessari.', 'پرداخت شما رد شد، لطفاً با بانک یا صادرکننده کارت خود تماس بگیرید و مطمئن شوید که وجوه لازم را دارید.', 'Din betalning avvisades, kontakta din bank eller kortutgivare och se till att du har de nödvändiga pengarna.', 'Thanh toán của bạn đã bị từ chối, vui lòng liên hệ với ngân hàng hoặc công ty phát hành thẻ của bạn và đảm bảo rằng bạn có số tiền cần thiết.', 'Din betaling blev afvist. Kontakt venligst din bank eller kortudsteder og sørg for, at du har de nødvendige midler.', 'Tinanggihan ang iyong pagbabayad, mangyaring makipag-ugnayan sa iyong bangko o tagabigay ng card at tiyaking mayroon ka ng mga kinakailangang pondo.'),
