(592, 'duration_fromat', '', 'Duration format must be like 03:33', 'يجب أن يكون تنسيق المدة مثل 03:33', 'Duurindeling moet ongeveer 03:33 zijn', 'Le format de la durée doit être comme 03:33', 'Das Dauerformat muss 03:33 sein', 'Формат продолжительности должен быть как 03:33', 'Formato de duración debe ser como 03:33', 'Süre biçimi, 03:33 gibi olmalıdır', 'अवधि प्रारूप 03:33 . जैसा होना चाहिए', '持续时间格式必须类似于 03:33', 'دورانیہ کی شکل 03:33 کی طرح ہونی چاہیے۔', 'Format durasi harus seperti 03:33', 'Format trajanja mora biti 03:33', 'פורמט משך הזמן חייב להיות כמו 03:33', 'সময়কাল বিন্যাস 03:33 এর মত হতে হবে', '期間の形式は 03:33 のようにする必要があります', 'O formato de duração deve ser como 03:33', 'Il formato della durata deve essere come 03:33', 'قالب مدت باید مانند 03:33 باشد', 'Varaktighetsformatet måste vara 03:33', 'Định dạng thời lượng phải như 03:33', 'Varighedsformatet skal være som 03:33', 'Ang format ng tagal ay dapat na tulad ng 03:33'),
(593, 'age_block_extra', '', 'Please note that if you are under 18, you won\'t be able to access this site. ', 'يرجى ملاحظة أنه إذا كان عمرك أقل من 18 عامًا ، فلن تتمكن من الوصول إلى هذا الموقع.', 'Houd er rekening mee dat als u jonger bent dan 18 jaar, u geen toegang kunt krijgen tot deze site.', 'Veuillez noter que si vous avez moins de 18 ans, vous ne pourrez pas accéder à ce site.', 'Bitte beachten Sie, dass Sie unter 18 Jahren nicht auf diese Website zugreifen können.', 'Обратите внимание, что если вам не исполнилось 18 лет, вы не сможете получить доступ к этому сайту.', 'Tenga en cuenta que si es menor de 18 años, no podrá acceder a este sitio.', 'Lütfen 18 yaşın altındaysanız bu siteye erişemeyeceğinizi unutmayın.', 'कृपया ध्यान दें कि यदि आपकी आयु 18 वर्ष से कम है, तो आप इस साइट तक नहीं पहुंच पाएंगे।', '请注意，如果您未满 18 岁，您将无法访问本网站。', 'براہ کرم نوٹ کریں کہ اگر آپ کی عمر 18 سال سے کم ہے، تو آپ اس سائٹ تک رسائی حاصل نہیں کر سکیں گے۔', 'Harap diperhatikan bahwa jika Anda berusia di bawah 18 tahun, Anda tidak akan dapat mengakses situs ini.', 'Imajte na umu da ako ste mlađi od 18 godina, nećete moći pristupiti ovoj stranici.', 'שים לב שאם אתה מתחת לגיל 18, לא תוכל לגשת לאתר זה.', 'দয়া করে মনে রাখবেন যে আপনার বয়স 18 বছরের কম হলে আপনি এই সাইটটি অ্যাক্সেস করতে পারবেন না।', '18 歳未満の方は、このサイトにアクセスできませんのでご注意ください。', 'Observe que, se você for menor de 18 anos, não poderá acessar este site.', 'Tieni presente che se hai meno di 18 anni, non sarai in grado di accedere a questo sito.', 'لطفا توجه داشته باشید که اگر زیر 18 سال دارید، نمی توانید به این سایت دسترسی پیدا کنید.', 'Observera att om du är under 18 år kommer du inte att kunna komma åt den här sidan.', 'Xin lưu ý rằng nếu bạn dưới 18 tuổi, bạn sẽ không thể truy cập trang web này.', 'Bemærk venligst, at hvis du er under 18 år, vil du ikke kunne få adgang til denne side.', 'Pakitandaan na kung wala ka pang 18 taong gulang, hindi mo maa-access ang site na ito.'),
(594, 'subscriber_price', '', 'Subscription Price (How much users will pay to subscribe to your channel?)', 'سعر الاشتراك (كم يدفع المستخدمون للاشتراك في قناتك؟)', 'Abonnementsprijs (Hoeveel gebruikers betalen zich om zich te abonneren op je kanaal?)', 'Prix de l\'abonnement (Combien d\'utilisateurs paieront-ils pour s\'abonner à votre chaîne?)', 'Abonnementpreis (Wie viel Nutzer zahlen, um Ihren Kanal zu abonnieren?)', 'Цена подписки (сколько пользователи будут платить за подписку на ваш канал?)', 'Precio de suscripción (¿Cuánto pagarán los usuarios para suscribirse a tu canal?)', 'Abonelik Fiyatı (Kanalınıza abone olmak için ne kadar kullanıcı ödeyecek?)', 'सदस्यता मूल्य (आपके चैनल की सदस्यता के लिए उपयोगकर्ता कितना भुगतान करेंगे?)', '订阅价格（用户订阅您的频道需要支付多少费用？）', 'سبسکرپشن کی قیمت (صارفین آپ کے چینل کو سبسکرائب کرنے کے لیے کتنی رقم ادا کریں گے؟)', 'Harga Berlangganan (Berapa banyak yang akan dibayar pengguna untuk berlangganan saluran Anda?)', 'Cijena pretplate (Koliko će korisnici platiti da se pretplate na vaš kanal?)', 'מחיר מנוי (כמה משתמשים ישלמו כדי להירשם לערוץ שלך?)', 'সাবস্ক্রিপশন মূল্য (আপনার চ্যানেলে সাবস্ক্রাইব করতে ব্যবহারকারীরা কত টাকা দেবেন?)', 'サブスクリプション価格 (ユーザーがあなたのチャンネルにサブスクライブするために支払う金額は?)', 'Preço da assinatura (Quanto os usuários pagarão para se inscrever no seu canal?)', 'Prezzo di abbonamento (Quanto pagheranno gli utenti per iscriversi al tuo canale?)', 'قیمت اشتراک (کاربران برای عضویت در کانال شما چقدر می پردازند؟)', 'Prenumerationspris (Hur mycket betalar användare för att prenumerera på din kanal?)', 'Giá đăng ký (Người dùng sẽ trả bao nhiêu để đăng ký kênh của bạn?)', 'Abonnementspris (Hvor meget betaler brugerne for at abonnere på din kanal?)', 'Presyo ng Subscription (Magkano ang babayaran ng mga user para mag-subscribe sa iyong channel?)'),
