(596, 'buy_or_subscribe', '', 'Buy now, OR unlock all content of {{USERNAME}} for just {{PRICE}} a month!', 'اشتر الآن ، أو افتح جميع محتويات {{USERNAME}} لمجرد {{PRICE}} في الشهر فقط!', 'Koop nu, OF ontgrendel alle content van {{USERNAME}} voor slechts {{PRICE}} per maand!', 'Achetez maintenant OU déverrouillez tout le contenu de {{USERNAME}} pour seulement {{PRICE}} un mois!', 'Kaufen Sie jetzt oder schalten Sie den gesamten Inhalt von {{USERNAME}} für nur {{PRICE}} einen Monat frei!', 'Купите сейчас, ИЛИ разблокируйте весь контент {{USERNAME}} всего за {{PRICE}} месяц!', '¡Compre ahora, O desbloquee todo el contenido de {{USERNAME}} por solo {{PRICE}} al mes!', 'Hemen satın alın VEYA bir ay boyunca {{PRICE}} için {{USERNAME}} içeriğinin tüm kilidini açın!', 'अभी खरीदें, या {{USERNAME}} की सभी सामग्री को केवल {{PRICE}} महीने में अनलॉक करें!', '立即购买，或以每月 {{PRICE}} 的价格解锁 {{USERNAME}} 的所有内容！', 'ابھی خریدیں، یا صرف {{PRICE}} ماہانہ میں {{USERNAME}} کے تمام مواد کو غیر مقفل کریں!', 'Beli sekarang, ATAU buka kunci semua konten {{USERNAME}} hanya dengan {{PRICE}} sebulan!', 'Kupite sada ILI otključajte sav sadržaj {{USERNAME}} za samo {{PRICE}} mjesečno!', 'קנה עכשיו, או בטל את הנעילה של כל התוכן של {{USERNAME}} תמורת {{PRICE}} בלבד לחודש!', 'এখনই কিনুন, অথবা মাত্র {{PRICE}} মাসে {{USERNAME}}-এর সমস্ত সামগ্রী আনলক করুন!', '今すぐ購入するか、月額わずか {{PRICE}} で {{USERNAME}} のすべてのコンテンツをアンロックしましょう!', 'Compre agora OU desbloqueie todo o conteúdo de {{USERNAME}} por apenas {{PRICE}} por mês!', 'Acquista ora O sblocca tutti i contenuti di {{USERNAME}} a soli {{PRICE}} al mese!', 'اکنون بخرید، یا قفل تمام محتوای {{USERNAME}} را فقط با {{PRICE}} در ماه باز کنید!', 'Köp nu, ELLER lås upp allt innehåll från {{USERNAME}} för bara {{PRICE}} i månaden!', 'Mua ngay bây giờ HOẶC mở khóa tất cả nội dung của {{USERNAME}} chỉ với {{PRICE}} một tháng!', 'Køb nu, ELLER lås op for alt indhold fra {{USERNAME}} for kun {{PRICE}} om måneden!', 'Bumili ngayon, O i-unlock ang lahat ng nilalaman ni {{USERNAME}} sa halagang {{PRICE}} lang sa isang buwan!'),
(597, 'subscribe_to_see', '', 'Subscribe for {{PRICE}} and unlock all the videos.', 'اشترك في {{PRICE}} واطلق العنان لجميع مقاطع الفيديو.', 'Abonneer je op {{PRICE}} en ontgrendel alle video\'s.', 'Abonnez-vous à {{PRICE}} et déverrouillez toutes les vidéos.', 'Abonniere {{PRICE}} und schalte alle Videos frei.', 'Подпишитесь на {{PRICE}} и разблокируйте все видео.', 'Suscríbete para {{PRICE}} y desbloquea todos los videos.', '{{PRICE}} için abone olun ve tüm videoların kilidini açın.', '{{PRICE}} की सदस्यता लें और सभी वीडियो अनलॉक करें।', '订阅 {{PRICE}} 并解锁所有视频。', '{{PRICE}} میں سبسکرائب کریں اور تمام ویڈیوز کو غیر مقفل کریں۔', 'Berlangganan seharga {{PRICE}} dan buka kunci semua video.', 'Pretplatite se za {{PRICE}} i otključajte sve videozapise.', 'הירשם עבור {{PRICE}} ובטל את הנעילה של כל הסרטונים.', '{{PRICE}}-এ সদস্যতা নিন এবং সমস্ত ভিডিও আনলক করুন৷', '{{PRICE}}で購読して、すべてのビデオのロックを解除してください。', 'Inscreva-se por {{PRICE}} e desbloqueie todos os vídeos.', 'Abbonati a {{PRICE}} e sblocca tutti i video.', 'برای {{PRICE}} مشترک شوید و قفل همه ویدیوها را باز کنید.', 'Prenumerera för {{PRICE}} och lås upp alla videor.', 'Đăng ký với {{PRICE}} và mở khóa tất cả các video.', 'Abonner for {{PRICE}} og lås op for alle videoerne.', 'Mag-subscribe sa halagang {{PRICE}} at i-unlock ang lahat ng video.'),
