(599, 'unsubscribe_from_channel', '', 'Are you sure you want to unsubscribe? This action can\'t be undo.', 'هل أنت متأكد أنك تريد إلغاء الاشتراك؟ هذا الإجراء لا يمكن التراجع.', 'Weet je zeker dat je je wilt afmelden? Deze actie kan niet ongedaan maken.', 'Êtes-vous sûr de vouloir résilier votre abonnement? Cette action ne peut pas être annuler.', 'Sind Sie sicher, dass Sie sich abmelden wollen? Diese Aktion kann nicht rückgängig gemacht werden.', 'Вы уверены, что хотите отказаться от подписки? Это действие не может быть отмена.', '¿Seguro que desea darse de baja? Esta acción no se puede deshacer.', 'Eğer aboneliğinizi iptal etmek istediğinizden emin misiniz? Bu eylem geri alınamaz.', 'क्या आप वाकई सदस्यता समाप्त करना चाहते हैं? इस कार्रवाई को पूर्ववत नहीं किया जा सकता.', '您确定要退订吗？此操作无法撤消。', 'کیا آپ واقعی ان سبسکرائب کرنا چاہتے ہیں؟ اس کارروائی کو کالعدم نہیں کیا جا سکتا۔', 'Anda yakin ingin berhenti berlangganan? Tindakan ini tidak dapat diurungkan.', 'Jeste li sigurni da želite otkazati pretplatu? Ova se radnja ne može poništiti.', 'האם אתה בטוח שברצונך לבטל את המנוי? לא ניתן לבטל את הפעולה הזו.', 'আপনি সদস্যতামুক্ত চান? এই ক্রিয়াটি পূর্বাবস্থায় ফেরানো যাবে না৷', '登録を解除してもよろしいですか？このアクションは元に戻せません。', 'Tem certeza de que deseja cancelar a inscrição? Esta ação não pode ser desfeita.', 'Sei sicuro che vuoi annullare l&#39;iscrizione? Questa azione non può essere annullata.', 'آیا مطمئن هستید که می خواهید اشتراک خود را لغو کنید؟ این عمل قابل واگرد نیست.', 'Är du säker på att du vill avsluta prenumerationen? Den här åtgärden kan inte ångras.', 'Bạn có chắc bạn muốn ngừng theo dõi? Không thể hoàn tác hành động này.', 'Er du sikker på, at du vil afmelde? Denne handling kan ikke fortrydes.', 'Sigurado ka bang gusto mong mag-unsubscribe? Ang pagkilos na ito ay hindi maaaring i-undo.'),
(600, 'file_not_supported', '', 'File format is not supported', 'لا يتم اعتماد تنسيق الملف', 'Bestandsformaat wordt niet ondersteund', 'Format de fichier non pris en charge', 'Datei-Format wird nicht unterstützt', 'Формат файла не поддерживается', 'Formato de archivo no es compatible', 'Dosya biçimi desteklenmiyor', 'फ़ाइल प्रारूप समर्थित नहीं है', '不支持文件格式', 'فائل فارمیٹ تعاون یافتہ نہیں ہے۔', 'Format file tidak didukung', 'Format datoteke nije podržan', 'פורמט הקובץ אינו נתמך', 'ফাইল ফরম্যাট সমর্থিত নয়', 'ファイル形式がサポートされていません', 'O formato do arquivo não é compatível', 'Il formato file non è supportato', 'فرمت فایل پشتیبانی نمی شود', 'Filformat stöds inte', 'Định dạng tệp không được hỗ trợ', 'Filformatet understøttes ikke', 'Hindi sinusuportahan ang format ng file'),
(601, 'report_copyright', '', 'Report Copyright', 'تقرير حقوق الطبع والنشر', 'rapport Copyright', 'rapport droit d\'auteur', 'Bericht Urheberrecht', 'Отчет Copyright', 'informe de Derechos de autor', 'Hakkı bildir', 'रिपोर्ट कॉपीराइट', '报告版权', 'کاپی رائٹ کی اطلاع دیں۔', 'Laporkan Hak Cipta', 'Prijavi autorska prava', 'דווח על זכויות יוצרים', 'কপিরাইট রিপোর্ট করুন', '著作権を報告する', 'Denunciar direitos autorais', 'Segnala il diritto d&#39;autore', 'گزارش حق چاپ', 'Rapportera upphovsrätt', 'Báo cáo Bản quyền', 'Rapportér ophavsret', 'Iulat ang Copyright'),
(602, 'create_notice', '', 'Create DMCA take down notice', 'خلق اتخاذ DMCA أسفل إشعار', 'Maak DMCA take down kennisgeving', 'Créer DMCA abattre avis', 'Erstellen DMCA take down Ankündigung', 'Создание DMCA снимать уведомления', 'Crear DMCA acabar aviso', 'haber aşağı çekmek DMCA Oluştur', 'DMCA टेक डाउन नोटिस बनाएं', '创建 DMCA 删除通知', 'DMCA ٹیک ڈاؤن نوٹس بنائیں', 'Buat pemberitahuan penghapusan DMCA', 'Izradite DMCA obavijest o uklanjanju', 'צור הודעת הסרה של DMCA', 'DMCA টেক ডাউন নোটিশ তৈরি করুন', 'DMCA 削除通知を作成する', 'Criar aviso de remoção de DMCA', 'Crea avviso di rimozione DMCA', 'اخطار حذف DMCA ایجاد کنید', 'Skapa meddelande om DMCA-borttagning', 'Tạo thông báo gỡ xuống DMCA', 'Opret DMCA-meddelelse om fjernelse', 'Gumawa ng DMCA take down notice'),
(603, 'describe_notice', '', 'Please describe your request carefully and as much as you can, note that false DMCA requests can lead to account termination.', 'يرجى وصف طلبك بعناية وبقدر ما يمكن، لاحظ أن طلبات DMCA كاذبة يمكن أن يؤدي إلى إنهاء الحساب.', 'Beschrijf uw verzoek zorgvuldig en zoveel als je kunt, er rekening mee dat valse DMCA verzoeken kunnen leiden tot beëindiging van het account.', 'S\'il vous plaît décrire votre demande avec soin et autant que vous le pouvez, notez que les fausses demandes DMCA peuvent conduire à la résiliation du compte.', 'Bitte beschreiben Sie Ihre Anfrage sorgfältig und so viel Sie können, beachten Sie, dass falsche DMCA-Anfragen zur Kündigung des Kontos führen kann.', 'Пожалуйста, опишите вашу просьбу тщательно и столько, сколько вы можете, обратите внимание, что ложные DMCA запросы могут привести к блокировке аккаунта.', 'Por favor describa su solicitud con cuidado y lo más que puede, tenga en cuenta que las solicitudes DMCA falsas pueden dar lugar a la cancelación de cuenta.', 'Eğer yanlış DMCA istekleri hesabın kapatılmasına yol unutmayınız gibi dikkatle ve kadar isteğinizi anlatın.', 'कृपया अपने अनुरोध का ध्यानपूर्वक वर्णन करें और जितना हो सके, ध्यान दें कि झूठे DMCA अनुरोधों से खाता समाप्त किया जा सकता है।', '请尽可能详细地描述您的请求，注意虚假的 DMCA 请求可能导致帐户终止。', 'براہ کرم اپنی درخواست کو احتیاط سے بیان کریں اور جتنا ہو سکے، نوٹ کریں کہ DMCA کی غلط درخواستیں اکاؤنٹ کو ختم کرنے کا باعث بن سکتی ہیں۔', 'Harap jelaskan permintaan Anda dengan hati-hati dan sebanyak yang Anda bisa, perhatikan bahwa permintaan DMCA palsu dapat menyebabkan penghentian akun.', 'Pažljivo opišite svoj zahtjev i koliko god možete imajte na umu da lažni DMCA zahtjevi mogu dovesti do ukidanja računa.', 'אנא תאר את בקשתך בקפידה ובמידת האפשר, שים לב שבקשות DMCA כוזבות עלולות להוביל לסגירת חשבון.', 'অনুগ্রহ করে আপনার অনুরোধটি সাবধানতার সাথে বর্ণনা করুন এবং আপনি যতটা পারেন, মনে রাখবেন যে মিথ্যা DMCA অনুরোধগুলি অ্যাকাউন্ট বন্ধ করে দিতে পারে।', 'リクエストを慎重に説明してください。可能な限り、虚偽の DMCA リクエストはアカウントの停止につながる可能性があることに注意してください。', 'Descreva sua solicitação com cuidado e, tanto quanto possível, observe que solicitações falsas de DMCA podem levar ao encerramento da conta.', 'Descrivi la tua richiesta con attenzione e quanto più possibile, tieni presente che richieste DMCA false possono portare alla chiusura dell&#39;account.', 'لطفاً درخواست خود را با دقت شرح دهید و تا جایی که می توانید، توجه داشته باشید که درخواست های نادرست DMCA می تواند منجر به فسخ حساب شود.', 'Beskriv din begäran noggrant och så mycket du kan. Observera att falska DMCA-förfrågningar kan leda till att kontot avslutas.', 'Vui lòng mô tả yêu cầu của bạn một cách cẩn thận và nhiều nhất có thể, lưu ý rằng các yêu cầu DMCA sai có thể dẫn đến việc chấm dứt tài khoản.', 'Beskriv venligst din anmodning omhyggeligt og så meget du kan. Bemærk, at falske DMCA-anmodninger kan føre til kontolukning.', 'Pakilarawan nang mabuti ang iyong kahilingan at hangga&#39;t kaya mo, tandaan na ang mga maling kahilingan sa DMCA ay maaaring humantong sa pagwawakas ng account.'),
(604, 'confirm_1_text', '', 'I have a good faith belief that use of the copyrighted work described above is not authorized by the copyright owner, its agent or the law', 'لدي اعتقاد راسخ بأن استخدام من الطبع والنشر المذكورة أعلاه غير مخول من قبل صاحب حق المؤلف أو وكيله أو القانون', 'Ik heb een goed vertrouwen geloven dat het gebruik van het auteursrechtelijk beschermde werk hiervoor geen toestemming is verleend door de auteursrechthebbende, diens vertegenwoordiger of de wet', 'J\'ai une bonne foi que l\'utilisation de l\'œuvre protégée décrite ci-dessus ne sont pas autorisée par le titulaire du droit d\'auteur, son agent ou la loi', 'Ich habe einen guten Glauben, die oben beschrieben der urheberrechtlich geschützten Arbeit verwenden wird nicht vom Inhaber des Urheberrechts, dessen Agenten oder per Gesetz', 'У меня есть добросовестное предположение, что использование защищенных авторским правом работ, описанных выше, не разрешено владельцем авторского права, его агентом или законом', 'Tengo una buena fe que el uso de la obra con derechos de autor descrito anteriormente no está autorizado por el propietario del copyright, su agente o la ley', 'Telif hakkı sahibi, temsilcisi veya yasalar tarafından izin verilmediğine Yukarıda açıklanan telif hakkı eserin kullanmak bir samimiyetle inanıyorum', 'मुझे अच्छा विश्वास है कि ऊपर वर्णित कॉपीराइट कार्य का उपयोग कॉपीराइट स्वामी, उसके एजेंट या कानून द्वारा अधिकृत नहीं है', '我确信使用上述受版权保护的作品未经版权所有者、其代理人或法律授权', 'مجھے نیک نیتی سے یقین ہے کہ اوپر بیان کردہ کاپی رائٹ شدہ کام کا استعمال کاپی رائٹ کے مالک، اس کے ایجنٹ یا قانون کے ذریعہ مجاز نہیں ہے', 'Saya yakin dengan niat baik bahwa penggunaan karya berhak cipta yang dijelaskan di atas tidak diizinkan oleh pemilik hak cipta, agennya, atau hukum', 'U dobroj vjeri vjerujem da korištenje gore opisanog djela zaštićenog autorskim pravima nije ovlašteno od strane vlasnika autorskih prava, njegovog predstavnika ili zakona', 'אני מאמין בתום לב שהשימוש ביצירה המוגנת בזכויות יוצרים המתוארת לעיל אינו מורשה על ידי בעל זכויות היוצרים, סוכנו או החוק', 'আমার সৎ বিশ্বাস আছে যে উপরে বর্ণিত কপিরাইটযুক্ত কাজের ব্যবহার কপিরাইট মালিক, এর এজেন্ট বা আইন দ্বারা অনুমোদিত নয়', '私は、上記の著作物の使用が、著作権所有者、その代理人、または法律によって許可されていないことを確信しています。', 'Acredito de boa fé que o uso do trabalho protegido por direitos autorais descrito acima não é autorizado pelo proprietário dos direitos autorais, seu agente ou pela lei', 'Ritengo in buona fede che l&#39;uso dell&#39;opera protetta da copyright sopra descritta non sia autorizzato dal titolare del copyright, dal suo agente o dalla legge', 'من با حسن نیت اعتقاد دارم که استفاده از اثر دارای حق نسخه برداری شرح داده شده در بالا توسط مالک حق نسخه برداری، نماینده آن یا قانون مجاز نیست.', 'Jag tror i god tro att användningen av det upphovsrättsskyddade verket som beskrivs ovan inte är auktoriserat av upphovsrättsinnehavaren, dess agent eller lagen', 'Tôi thực sự tin rằng việc sử dụng tác phẩm có bản quyền được mô tả ở trên không được chủ sở hữu bản quyền, đại diện của chủ sở hữu bản quyền hoặc luật pháp cho phép', 'Jeg er i god tro overbevist om, at brugen af det ophavsretligt beskyttede værk beskrevet ovenfor ikke er godkendt af ophavsretsejeren, dennes agent eller loven', 'Mayroon akong magandang loob na paniniwala na ang paggamit ng naka-copyright na gawa na inilarawan sa itaas ay hindi pinahihintulutan ng may-ari ng copyright, ahente nito o ng batas'),
(605, 'confirm_2_text', '', 'I confirm that I am the copyright owner or am authorised to act on behalf of the owner of an exclusive right that is allegedly infringed.', 'أؤكد أنني صاحب حق المؤلف أو مرخص لي بالتصرف نيابة عن صاحب الحق الحصري الذي يزعم انتهاكه.', 'Ik bevestig dat ik de eigenaar van het auteursrecht of bevoegd ben te handelen namens de eigenaar van een exclusief recht dat de vermeende inbreuk.', 'Je confirme que je suis le propriétaire du droit d\'auteur ou autorisé à agir au nom du propriétaire d\'un droit exclusif qui aurait été violé.', 'Ich bestätige, dass ich der Inhaber des Urheberrechts bin oder bin, im Namen des Inhabers eines exklusiven Rechts zu handeln, das angeblich verletzt wird.', 'Я подтверждаю, что я являюсь владельцем авторского права или имею право действовать от имени владельца исключительного права, которое предположительно было нарушено.', 'Confirmo que soy el propietario del copyright o estoy autorizado a actuar en nombre del propietario de un derecho exclusivo que presuntamente se ha infringido.', 'Ben telif hakkı sahibi olduğuma veya ihlal edildiği iddia edilen münhasır hakkın sahibi adına hareket etmeye yetkili doğruluyorum.', 'मैं पुष्टि करता हूं कि मैं कॉपीराइट का स्वामी हूं या एक विशेष अधिकार के स्वामी की ओर से कार्य करने के लिए अधिकृत हूं जिसका कथित रूप से उल्लंघन किया गया है।', '我确认我是版权所有者或被授权代表涉嫌侵权的专有权的所有者行事。', 'میں تصدیق کرتا ہوں کہ میں کاپی رائٹ کا مالک ہوں یا کسی ایسے خصوصی حق کے مالک کی جانب سے کارروائی کرنے کا مجاز ہوں جس کی مبینہ طور پر خلاف ورزی کی گئی ہو۔', 'Saya menegaskan bahwa saya adalah pemilik hak cipta atau berwenang untuk bertindak atas nama pemilik hak eksklusif yang diduga dilanggar.', 'Potvrđujem da sam vlasnik autorskog prava ili da sam ovlašten djelovati u ime vlasnika ekskluzivnog prava koje je navodno povrijeđeno.', 'אני מאשר שאני הבעלים של זכויות היוצרים או מורשה לפעול בשמו של הבעלים של זכות בלעדית שהופרה לכאורה.', 'আমি নিশ্চিত করছি যে আমি কপিরাইটের মালিক বা আমি লঙ্ঘন করা একচেটিয়া অধিকারের মালিকের পক্ষে কাজ করার জন্য অনুমোদিত৷', '私は、私が著作権所有者であるか、または侵害されているとされる独占権の所有者に代わって行動する権限を与えられていることを確認します.', 'Confirmo que sou o proprietário dos direitos autorais ou estou autorizado a agir em nome do proprietário de um direito exclusivo que supostamente foi violado.', 'Confermo di essere il titolare del copyright o di essere autorizzato ad agire per conto del titolare di un diritto esclusivo presumibilmente violato.', 'تأیید می‌کنم که مالک حق نسخه‌برداری هستم یا مجازم از طرف مالک حق انحصاری که ادعا می‌شود نقض شده است اقدام کنم.', 'Jag bekräftar att jag är upphovsrättsinnehavaren eller är behörig att agera på uppdrag av ägaren av en exklusiv rättighet som påstås ha kränkts.', 'Tôi xác nhận rằng tôi là chủ sở hữu bản quyền hoặc được ủy quyền thay mặt cho chủ sở hữu độc quyền bị cáo buộc là vi phạm.', 'Jeg bekræfter, at jeg er ophavsretsejeren eller er autoriseret til at handle på vegne af ejeren af en eksklusiv rettighed, der angiveligt er krænket.', 'Kinukumpirma ko na ako ang may-ari ng copyright o awtorisado akong kumilos sa ngalan ng may-ari ng isang eksklusibong karapatan na di-umano&#39;y nilabag.'),
(606, 'confirm_check_text', '', 'Please select the checkboxs below if you own the copyright.', 'يرجى تحديد مربعات الاختيار أدناه إذا كنت تملك حقوق التأليف والنشر.', 'Selecteer de vakjes hieronder als u het copyright bezit.', 'S\'il vous plaît cocher les cases ci-dessous si vous possédez le droit d\'auteur.', 'Bitte wählen Sie die Kontrollkästchen unten, wenn Sie das Urheberrecht besitzen.', 'Пожалуйста, отметьте флажки ниже, если вы являетесь владельцем авторских прав.', 'Por favor, seleccione las casillas de verificación a continuación si es el propietario del derecho de autor.', 'telif hakkına sahip olmadığını aşağıdaki onay kutularını seçin.', 'यदि आप कॉपीराइट के स्वामी हैं, तो कृपया नीचे दिए गए चेकबॉक्स का चयन करें।', '如果您拥有版权，请选中下面的复选框。', 'اگر آپ کاپی رائٹ کے مالک ہیں تو براہ کرم نیچے چیک باکسز کو منتخب کریں۔', 'Harap pilih kotak centang di bawah jika Anda memiliki hak cipta.', 'Odaberite potvrdne okvire ispod ako ste vlasnik autorskih prava.', 'אנא בחר את תיבות הסימון למטה אם אתה הבעלים של זכויות היוצרים.', 'আপনি কপিরাইট মালিক যদি নীচের চেকবক্স নির্বাচন করুন.', '著作権を所有している場合は、以下のチェックボックスを選択してください。', 'Por favor, marque as caixas de seleção abaixo se você possui os direitos autorais.', 'Si prega di selezionare le caselle di controllo qui sotto se si possiede il copyright.', 'لطفاً در صورتی که حق چاپ را دارید، کادرهای زیر را انتخاب کنید.', 'Markera kryssrutorna nedan om du äger upphovsrätten.', 'Vui lòng chọn các hộp kiểm bên dưới nếu bạn sở hữu bản quyền.', 'Vælg venligst afkrydsningsfelterne nedenfor, hvis du ejer ophavsretten.', 'Mangyaring piliin ang mga checkbox sa ibaba kung pagmamay-ari mo ang copyright.'),
(607, 'personal_photo', '', 'Your Personal Photo', 'صورتك الشخصية', 'Uw Personal Photo', 'Votre Photo personnelle', 'Ihr persönliches Foto', 'Ваша Фотография', 'Su foto personal', 'Kişisel Fotoğraf', 'आपकी व्यक्तिगत फोटो', '您的个人照片', 'آپ کی ذاتی تصویر', 'Foto Pribadi Anda', 'Vaša osobna fotografija', 'התמונה האישית שלך', 'আপনার ব্যক্তিগত ছবি', 'あなたの個人的な写真', 'Sua foto pessoal', 'La tua foto personale', 'عکس شخصی شما', 'Ditt personliga foto', 'Ảnh cá nhân của bạn', 'Dit personlige foto', 'Ang iyong Personal na Larawan'),
(608, 'passport_id', '', 'Passport / ID card', 'جواز السفر / بطاقة الهوية', 'Paspoort / ID-kaart', 'Passeport / carte d\'identité', 'Reisepass / Personalausweis', 'Паспорт / удостоверение личности', 'Pasaporte / tarjeta de ID', 'Pasaport / kimlik kartı', 'पासपोर्ट / आईडी कार्ड', '护照/身份证', 'پاسپورٹ/شناختی کارڈ', 'Paspor / KTP', 'Putovnica/osobna iskaznica', 'דרכון / תעודת זהות', 'পাসপোর্ট/আইডি কার্ড', 'パスポート・IDカード', 'Passaporte / carteira de identidade', 'Passaporto/carta d&#39;identità', 'گذرنامه / کارت شناسایی', 'Pass / ID-kort', 'Hộ chiếu / thẻ căn cước', 'Pas / ID-kort', 'Pasaporte / ID card'),
