(610, 'submit_monetization_request_error', '', 'You can not submit monetization request until the previous request has been accepted / rejected.', 'لا يمكنك تقديم طلب تسييل حتى تم قبول الطلب السابق / رفض.', 'U kunt inkomsten geen verzoek indienen tot de vorige aanvraag is geaccepteerd / verworpen.', 'Vous ne pouvez pas soumettre la demande de monétisation jusqu\'à ce que la demande précédente a été acceptée / refusée.', 'Sie können nicht Monetisierung Anfrage, bis die vorherige Anfrage wurde akzeptiert / abgelehnt einreichen.', 'Вы не можете отправить запрос о монетизации, пока предыдущий запрос не был принят / отклонен.', 'No se puede enviar la solicitud de monetización hasta que la solicitud anterior ha sido aceptado / rechazado.', 'Bir önceki isteği kabul edilinceye kadar para kazanma isteği gönderemezsiniz / reddetmiştir.', 'आप तब तक मुद्रीकरण अनुरोध सबमिट नहीं कर सकते जब तक कि पिछला अनुरोध स्वीकार/अस्वीकार न कर दिया गया हो।', '在之前的请求被接受/拒绝之前，您无法提交获利请求。', 'آپ منیٹائزیشن کی درخواست اس وقت تک جمع نہیں کر سکتے جب تک کہ پچھلی درخواست کو قبول/مسترد نہ کر دیا جائے۔', 'Anda tidak dapat mengirimkan permintaan monetisasi sampai permintaan sebelumnya telah diterima/ditolak.', 'Ne možete podnijeti zahtjev za unovčavanjem dok se prethodni zahtjev ne prihvati/odbije.', 'לא ניתן להגיש בקשת מונטיזציה עד שהבקשה הקודמת תתקבל/נדחתה.', 'আগের অনুরোধ গৃহীত/প্রত্যাখ্যান না হওয়া পর্যন্ত আপনি নগদীকরণের অনুরোধ জমা দিতে পারবেন না।', '前のリクエストが承認または拒否されるまで、収益化リクエストを送信することはできません。', 'Você não pode enviar a solicitação de monetização até que a solicitação anterior tenha sido aceita/rejeitada.', 'Non è possibile inviare una richiesta di monetizzazione fino a quando la richiesta precedente non è stata accettata/rifiutata.', 'شما نمی توانید درخواست کسب درآمد را تا زمانی که درخواست قبلی پذیرفته / رد شده است ارسال کنید.', 'Du kan inte skicka in en begäran om intäktsgenerering förrän den tidigare begäran har accepterats/avvisats.', 'Bạn không thể gửi yêu cầu kiếm tiền cho đến khi yêu cầu trước đó được chấp nhận / bị từ chối.', 'Du kan ikke indsende anmodning om indtægtsgenerering, før den tidligere anmodning er blevet accepteret/afvist.', 'Hindi ka maaaring magsumite ng kahilingan sa monetization hanggang sa ang nakaraang kahilingan ay tinanggap / tinanggihan.'),
