(624, 'your_ads_will_stop', '', 'Your ads will stop running once you reach this amount.', 'سيتوقف عرض إعلاناتك بمجرد وصولك إلى هذا المبلغ.', 'Uw advertenties worden niet meer weergegeven zodra u dit bedrag heeft bereikt.', 'Vos annonces ne seront plus diffusées une fois ce montant atteint.', 'Ihre Anzeigen werden nicht mehr geschaltet, sobald Sie diesen Betrag erreicht haben.', 'Ваши объявления прекратят показ, как только вы достигнете этой суммы.', 'Sus anuncios dejarán de publicarse una vez que alcance esta cantidad.', 'Bu miktara ulaştığınızda reklamlarınızın yayını durdurulur.', 'इस राशि तक पहुंचने के बाद आपके विज्ञापन चलना बंद हो जाएंगे।', '达到此数量后，您的广告将停止投放。', 'اس رقم تک پہنچنے کے بعد آپ کے اشتہارات چلنا بند ہو جائیں گے۔', 'Iklan Anda akan berhenti berjalan setelah Anda mencapai jumlah ini.', 'Vaši će se oglasi prestati prikazivati kada dosegnete ovaj iznos.', 'המודעות שלך יפסיקו לפעול ברגע שתגיע לסכום זה.', 'আপনি এই পরিমাণে পৌঁছালে আপনার বিজ্ঞাপনগুলি চলা বন্ধ হয়ে যাবে।', 'この金額に達すると、広告の掲載が停止されます。', 'Seus anúncios deixarão de ser exibidos quando você atingir esse valor.', 'I tuoi annunci smetteranno di essere pubblicati una volta raggiunto questo importo.', 'با رسیدن به این مقدار، تبلیغات شما متوقف می شود.', 'Dina annonser slutar visas när du når detta belopp.', 'Quảng cáo của bạn sẽ ngừng chạy khi bạn đạt đến số tiền này.', 'Dine annoncer stopper med at køre, når du når dette beløb.', 'Hihinto sa pagtakbo ang iyong mga ad sa sandaling maabot mo ang halagang ito.'),
