(674, 'move_balance_to_wallet', '', 'Move your balance to your wallet so you can use it to create ads and use other features.', 'انقل رصيدك إلى محفظتك حتى تتمكن من استخدامه لإنشاء إعلانات واستخدام ميزات أخرى.', 'Verplaats uw saldo naar uw portemonnee, zodat u deze kunt gebruiken om advertenties te maken en andere functies te gebruiken.', 'Déplacez votre solde vers votre portefeuille afin de pouvoir l\'utiliser pour créer des publicités et utiliser d\'autres fonctionnalités.', 'Verschieben Sie Ihr Guthaben in Ihre Brieftasche, damit Sie damit Anzeigen erstellen und andere Funktionen verwenden können.', 'Переместите свой баланс в кошелек, чтобы вы могли использовать его для создания рекламы и других функций.', 'Mueva su saldo a su billetera para que pueda usarlo para crear anuncios y usar otras funciones.', 'Bakiyenizi cüzdanınıza taşıyın, böylece reklam oluşturmak ve diğer özellikleri kullanmak için kullanabilirsiniz.', 'अपनी शेष राशि को अपने बटुए में ले जाएं ताकि आप इसका उपयोग विज्ञापन बनाने और अन्य सुविधाओं का उपयोग करने के लिए कर सकें।', '将您的余额转移到您的钱包中，以便您可以使用它来制作广告和使用其他功能。', 'اپنا بیلنس اپنے بٹوے میں منتقل کریں تاکہ آپ اسے اشتہارات بنانے اور دیگر خصوصیات استعمال کرنے کے لیے استعمال کر سکیں۔', 'Pindahkan saldo Anda ke dompet Anda sehingga Anda dapat menggunakannya untuk membuat iklan dan menggunakan fitur lainnya.', 'Premjestite svoj saldo u svoj novčanik kako biste ga mogli koristiti za izradu oglasa i korištenje drugih značajki.', 'העבר את היתרה שלך לארנק שלך כדי שתוכל להשתמש בה כדי ליצור מודעות ולהשתמש בתכונות אחרות.', 'আপনার ব্যালেন্স আপনার ওয়ালেটে সরান যাতে আপনি বিজ্ঞাপন তৈরি করতে এবং অন্যান্য বৈশিষ্ট্যগুলি ব্যবহার করতে এটি ব্যবহার করতে পারেন৷', '残高をウォレットに移動して、広告の作成やその他の機能の使用に使用できるようにします。', 'Mova seu saldo para sua carteira para poder usá-lo para criar anúncios e usar outros recursos.', 'Sposta il tuo saldo nel tuo portafoglio in modo da poterlo utilizzare per creare annunci e utilizzare altre funzionalità.', 'موجودی خود را به کیف پول خود منتقل کنید تا بتوان