(760, 'upload_video_thumb_desc', '', 'Select or upload a picture that shows what\'s in your video. A good thumbnail stands out and draws viewers\' attention', 'حدد أو تحميل صورة توضح ما هو في الفيديو الخاص بك. ', 'Selecteer of upload een foto die laat zien wat er in uw video staat. ', 'Sélectionnez ou téléchargez une image qui indique ce qui est dans votre vidéo. ', 'Wählen Sie ein Bild aus, das zeigt, was in Ihrem Video in Ihrem Video ist. ', 'Выберите или загрузите изображение, которое показывает, что в вашем видео. ', 'Seleccione o cargue una imagen que muestre lo que hay en su video. ', 'Videonuzda ne olduğunu gösteren bir resim seçin veya yükleyin. ', 'ऐसा चित्र चुनें या अपलोड करें जो यह दर्शाता हो कि आपके वीडियो में क्या है। एक अच्छा थंबनेल सबसे अलग दिखता है और दर्शकों का ध्यान खींचता है', '选择或上传显示视频内容的图片。一个好的缩略图会脱颖而出并吸引观众的注意力', 'ایسی تصویر منتخب کریں یا اپ لوڈ کریں جو دکھائے کہ آپ کے ویڈیو میں کیا ہے۔ ایک اچھا تھمب نیل نمایاں ہوتا ہے اور ناظرین کی توجہ اپنی طرف کھینچتا ہے۔', 'Pilih atau unggah gambar yang menunjukkan isi video Anda. Thumbnail yang bagus menonjol dan menarik perhatian pemirsa', 'Odaberite ili prenesite sliku koja prikazuje što je u vašem videozapisu. Dobra sličica se ističe i privlači pozornost gledatelja', 'בחר או העלה תמונה שמראה מה יש בסרטון שלך. תמונה ממוזערת טובה בולטת ומושכת את תשומת לב הצופים', 'আপনার ভিডিওতে কী আছে তা দেখায় এমন একটি ছবি নির্বাচন করুন বা আপলোড করুন৷ একটি ভাল থাম্বনেইল দাঁড়িয়ে থাকে এবং দর্শকদের দৃষ্টি আকর্ষণ করে', 'ビデオの内容を示す画像を選択またはアップロードします。優れたサムネイルは目立ち、視聴者の注意を引きます', 'Selecione ou carregue uma imagem que mostre o que está no seu vídeo. Uma boa miniatura se destaca e chama a atenção dos espectadores', 'Seleziona o carica un&#39;immagine che mostri cosa c&#39;è nel tuo video. Una buona miniatura risalta e attira l&#39;attenzione degli spettatori', 'تصویری را انتخاب یا آپلود کنید که نشان دهد چه چیزی در ویدیوی شما وجود دارد. یک تصویر کوچک خوب برجسته است و توجه بینندگان را به خود جلب می کند', 'Välj eller ladda upp en bild som visar vad som finns i din video. En bra miniatyr sticker ut och drar tittarnas uppmärksamhet', 'Chọn hoặc tải lên hình ảnh hiển thị nội dung trong video của bạn. Một hình thu nhỏ tốt sẽ nổi bật và thu hút sự chú ý của người xem', 'Vælg eller upload et billede, der viser, hvad der er i din video. Et godt miniaturebillede skiller sig ud og tiltrækker seernes opmærksomhed', 'Pumili o mag-upload ng larawan na nagpapakita kung ano ang nasa iyong video. Ang isang magandang thumbnail ay namumukod-tangi at nakakakuha ng atensyon ng mga manonood'),
