(773, 'maintenance_text', '', 'Sorry for the inconvenience but we performing some maintenance at the moment. If you need help you can always', 'آسف للإزعاج لكننا نؤدي بعض الصيانة في الوقت الحالي. ', 'Sorry voor het ongemak, maar we uitvoeren op dit moment wat onderhoud. ', 'Désolé pour le désagrément occasionné, mais nous effectuons un peu de maintenance pour le moment. ', 'Entschuldigung für die Unannehmlichkeiten, aber wir haben im Moment etwas Wartung. ', 'Извините за неудобства, но мы выполняем некоторое обслуживание в данный момент. ', 'Lo siento por los inconvenientes, pero realizamos algún mantenimiento en este momento. ', 'Rahatsızlık için özür dilerim ama şu anda biraz bakım yapıyoruz. ', 'असुविधा के लिए खेद है, लेकिन हम इस समय कुछ रखरखाव कर रहे हैं। अगर आपको मदद की जरूरत है तो आप हमेशा कर सकते हैं', '很抱歉给您带来不便，但我们目前正在进行一些维护。如果您需要帮助，您可以随时', 'تکلیف کے لیے معذرت لیکن ہم اس وقت کچھ دیکھ بھال کر رہے ہیں۔ اگر آپ کو مدد کی ضرورت ہو تو آپ ہمیشہ کر سکتے ہیں۔', 'Mohon maaf atas ketidaknyamanannya, namun saat ini kami sedang melakukan pemeliharaan. Jika Anda membutuhkan bantuan, Anda selalu dapat', 'Ispričavamo se zbog neugodnosti, ali trenutačno radimo na održavanju. Ako trebate pomoć uvijek možete', 'מצטערים על אי הנוחות אך אנו מבצעים תחזוקה מסוימת כרגע. אם אתה צריך עזרה אתה תמיד יכול', 'অসুবিধার জন্য দুঃখিত কিন্তু আমরা এই মুহূর্তে কিছু রক্ষণাবেক্ষণ করছি। আপনার সাহায্যের প্রয়োজন হলে আপনি সবসময় করতে পারেন', 'ご迷惑をおかけいたしますが、現在メンテナンスを行っております。助けが必要な場合は、いつでもできます', 'Desculpe o transtorno, mas estamos realizando algumas manutenções no momento. Se precisar de ajuda pode sempre', 'Ci scusiamo per l&#39;inconveniente ma al momento stiamo effettuando alcuni lavori di manutenzione. Se hai bisogno di aiuto puoi sempre', 'با عرض پوزش برای ناراحتی، اما ما در حال انجام برخی از تعمیر و نگهداری. اگر به کمک نیاز دارید، همیشه می توانید', 'Ursäkta besväret men vi utför visst underhåll för tillfället. Om du behöver hjälp kan du alltid', 'Xin lỗi vì sự bất tiện này nhưng chúng tôi đang thực hiện một số bảo trì tại thời điểm này. Nếu bạn cần giúp đỡ, bạn luôn có thể', 'Beklager ulejligheden, men vi udfører noget vedligeholdelse i øjeblikket. Hvis du har brug for hjælp, kan du altid', 'Paumanhin para sa abala ngunit nagsasagawa kami ng ilang maintenance sa ngayon. Kung kailangan mo ng tulong maaari mong palaging'),
(774, 'well_be_back_shortly', '', 'otherwise, we will be back online shortly!', 'خلاف ذلك، سنعود عبر الإنترنت قريبا!', 'Anders zullen we binnenkort online zijn!', 'Sinon, nous serons de retour en ligne sous peu!', 'Ansonsten werden wir kurz online sein!', 'В противном случае мы вернемся в ближайшее время!', 'De lo contrario, volveremos en línea en breve!', 'Aksi takdirde, kısa sürede çevrimiçi olacağız!', 'अन्यथा, हम शीघ्र ही ऑनलाइन वापस आ जाएंगे!', '否则，我们很快就会重新上线！', 'دوسری صورت میں، ہم جلد ہی واپس آن لائن ہوں گے!', 'jika tidak, kami akan segera kembali online!', 'u protivnom, uskoro ćemo ponovno biti online!', 'אחרת, נחזור לאינטרנט בקרוב!', 'অন্যথায়, আমরা শীঘ্রই অনলাইনে ফিরে আসব!', 'それ以外の場合は、まもなくオンラインに戻ります。', 'caso contrário, estaremos de volta online em breve!', 'in caso contrario, saremo di nuovo online a breve!', 'در غیر این صورت، ما به زودی آنلاین خواهیم شد!', 'annars är vi snart online igen!', 'nếu không, chúng tôi sẽ trở lại trực tuyến trong thời gian ngắn!', 'ellers er vi snart online igen!', 'kung hindi, babalik kami online sa ilang sandali!'),
