(806, 'complexity_requirements', '', 'The password supplied does not meet the minimum complexity requirements.', 'لا تلبي كلمة المرور المقدمة الحد الأدنى من متطلبات التعقيد.', 'Het geleverde wachtwoord voldoet niet aan de minimale complexiteitsvereisten.', 'Le mot de passe fourni ne répond pas aux exigences de complexité minimale.', 'Das gelieferte Passwort entspricht nicht den Anforderungen an die Mindestkomplexität.', 'Поставляемый пароль не соответствует требованиям к минимальной сложности.', 'La contraseña suministrada no cumple con los requisitos mínimos de complejidad.', 'Sağlanan şifre, minimum karmaşıklık gereksinimlerini karşılamaz.', 'प्रदान किया गया पासवर्ड न्यूनतम जटिलता आवश्यकताओं को पूरा नहीं करता है।', '提供的密码不符合最低复杂性要求。', 'فراہم کردہ پاس ورڈ کم از کم پیچیدگی کی ضروریات کو پورا نہیں کرتا ہے۔', 'Kata sandi yang diberikan tidak memenuhi persyaratan kompleksitas minimum.', 'Isporučena lozinka ne zadovoljava minimalne zahtjeve složenosti.', 'הסיסמה שסופקה אינה עומדת בדרישות המורכבות המינימליות.', 'সরবরাহ করা পাসওয়ার্ডটি ন্যূনতম জটিলতার প্রয়োজনীয়তা পূরণ করে না।', '提供されたパスワードは、複雑さの最小要件を満たしていません。', 'A senha fornecida não atende aos requisitos mínimos de complexidade.', 'La password fornita non soddisfa i requisiti minimi di complessità.', 'رمز عبور ارائه شده حداقل الزامات پیچیدگی را برآورده نمی کند.', 'Lösenordet som tillhandahålls uppfyller inte kraven på minsta komplexitet.', 'Mật khẩu được cung cấp không đáp ứng các yêu cầu về độ phức tạp tối thiểu.', 'Den medfølgende adgangskode opfylder ikke minimumskravene til kompleksitet.', 'Ang ibinigay na password ay hindi nakakatugon sa pinakamababang kinakailangan sa pagiging kumplikado.'),
