(846, 'now_pro', '', 'Congratulations! You are now a pro user, start exploring new features!', 'تهانينا! أنت الآن مستخدم محترف ، ابدأ في استكشاف الميزات الجديدة!', 'Gefeliciteerd! Je bent nu een professionele gebruiker, begin met het verkennen van nieuwe functies!', 'Toutes nos félicitations! Vous êtes maintenant un utilisateur pro, commencez à explorer de nouvelles fonctionnalités !', 'Glückwunsch! Sie sind jetzt ein Profi-Benutzer, entdecken Sie neue Funktionen!', 'Поздравляем! Теперь вы профессиональный пользователь, начните изучать новые функции!', '¡Felicidades! Ahora eres un usuario profesional, ¡comienza a explorar nuevas funciones!', 'Tebrikler! Artık profesyonel bir kullanıcısınız, yeni özellikleri keşfetmeye başlayın!', 'बधाई हो! अब आप एक समर्थक उपयोगकर्ता हैं, नई सुविधाओं की खोज शुरू करें!', '恭喜！您现在是专业用户，开始探索新功能！', 'مبارک ہو! اب آپ ایک پرو صارف ہیں، نئی خصوصیات کو دریافت کرنا شروع کریں!', 'Selamat! Anda sekarang adalah pengguna pro, mulailah menjelajahi fitur-fitur baru!', 'Čestitamo! Sada ste profesionalni korisnik, počnite istraživati nove značajke!', 'מזל טוב! אתה עכשיו משתמש מקצוען, התחל לחקור תכונות חדשות!', 'অভিনন্দন! আপনি এখন একজন পেশাদার ব্যবহারকারী, নতুন বৈশিষ্ট্যগুলি অন্বেষণ শুরু করুন!', 'おめでとう！あなたはプロユーザーになりました。新しい機能を試してみてください!', 'Parabéns! Agora você é um usuário profissional, comece a explorar novos recursos!', 'Congratulazioni! Ora sei un utente professionista, inizia a esplorare nuove funzionalità!', 'تبریک می گویم! شما اکنون یک کاربر حرفه ای هستید، شروع به کاوش ویژگی های جدید کنید!', 'Grattis! Du är nu en proffsanvändare, börja utforska nya funktioner!', 'Chúc mừng! Bây giờ bạn là người dùng chuyên nghiệp, hãy bắt đầu khám phá các tính năng mới!', 'Tillykke! Du er nu en professionel bruger, begynd at udforske nye funktioner!', 'Binabati kita! Isa ka na ngayong pro user, simulan ang paggalugad ng mga bagong feature!'),
