(849, 'earn_users', '', 'Earn up to ${amount} for every user your refer to us!', 'اربح ما يصل إلى $ {amount} عن كل مستخدم تحيله إلينا!', 'Verdien tot ${amount} voor elke gebruiker die u naar ons doorverwijst!', 'Gagnez jusqu&#39;à {montant} $ pour chaque utilisateur que vous nous référez !', 'Verdienen Sie bis zu ${amount} für jeden Nutzer, den Sie an uns verweisen!', 'Зарабатывайте до ${amount} за каждого пользователя, которого вы к нам пригласите!', '¡Gane hasta ${cantidad} por cada usuario que nos recomiende!', 'Bize yönlendirdiğiniz her kullanıcı için ${amount}&#39;a kadar kazanın!', 'आपके द्वारा हमें संदर्भित प्रत्येक उपयोगकर्ता के लिए ${amount} तक कमाएं!', '为您推荐给我们的每个用户赚取高达 ${amount} 美元！', 'ہر اس صارف کے لیے ${amount} تک کمائیں جس کا آپ ہمیں حوالہ دیتے ہیں!', 'Hasilkan hingga ${amount} untuk setiap pengguna yang Anda referensikan kepada kami!', 'Zaradite do {amount} $ za svakog korisnika kojeg nam preporučite!', 'הרווח עד ${amount} עבור כל משתמש שאתה מפנה אלינו!', 'আপনি আমাদের রেফার করা প্রতিটি ব্যবহারকারীর জন্য ${amount} পর্যন্ত উপার্জন করুন!', 'ご紹介いただいたユーザーごとに最大 ${amount} を獲得しましょう!', 'Ganhe até ${amount} para cada usuário que você nos indicar!', 'Guadagna fino a ${amount} per ogni utente che ci presenti!', 'برای هر کاربری که به ما مراجعه می کنید، تا {amount} دلار کسب کنید!', 'Tjäna upp till ${amount} för varje användare du hänvisar till oss!', 'Kiếm tới ${amount} cho mọi người dùng mà bạn giới thiệu cho chúng tôi!', 'Tjen op til ${amount} for hver bruger, du henviser til os!', 'Kumita ng hanggang ${amount} para sa bawat user na iyong tinutukoy sa amin!'),
(850, 'earn_users_pro', '', 'Earn up to ${amount} for every user your refer to us and will subscribe to any of our pro packages.', 'اربح ما يصل إلى $ {amount} عن كل مستخدم تحيله إلينا وسوف يشترك في أي من باقاتنا الاحترافية.', 'Verdien tot ${amount} voor elke gebruiker die u naar ons doorverwijst en abonneer u op een van onze pro-pakketten.', 'Gagnez jusqu&#39;à {montant} $ pour chaque utilisateur que vous nous référez et souscrivez à l&#39;un de nos forfaits pro.', 'Verdienen Sie bis zu ${amount} für jeden Benutzer, den Sie an uns verweisen, und abonnieren Sie eines unserer Pro-Pakete.', 'Зарабатывайте до ${amount} за каждого пользователя, которого вы пригласите к нам и подпишетесь на любой из наших профессиональных пакетов.', 'Gane hasta ${cantidad} por cada usuario que nos recomiende y se suscriba a cualquiera de nuestros paquetes profesionales.', 'Bize yönlendirdiğiniz ve profesyonel paketlerimizden herhangi birine abone olacak her kullanıcı için ${amount}&#39;a kadar kazanın.', 'आपके द्वारा हमें संदर्भित प्रत्येक उपयोगकर्ता के लिए ${amount} तक कमाएं और हमारे किसी भी समर्थक पैकेज की सदस्यता लें।', '为您推荐给我们的每个用户赚取高达 ${amount} 的收入，并将订阅我们的任何专业套餐。', 'ہر صارف کے لیے ${amount} تک کمائیں جو آپ ہمیں بھیجتے ہیں اور ہمارے کسی بھی پرو پیکج کو سبسکرائب کریں گے۔', 'Hasilkan hingga ${amount} untuk setiap pengguna yang Anda referensikan kepada kami dan akan berlangganan paket pro kami.', 'Zaradite do {amount} USD za svakog korisnika kojeg nam preporučite i pretplatite se na bilo koji od naših profesionalnih paketa.', 'הרוויח עד ${amount} עבור כל משתמש שאתה מפנה אלינו ויירשם לכל אחת מחבילות המקצוענים שלנו.', 'আপনি আমাদের রেফার করা প্রতিটি ব্যবহারকারীর জন্য ${amount} পর্যন্ত উপার্জন করুন এবং আমাদের যেকোনো প্রো প্যাকেজে সদস্যতা নেবেন।', 'ご紹介いただいたユーザーごとに最大 ${amount} を獲得し、いずれかのプロ パッケージを購読します。', 'Ganhe até ${amount} para cada usuário que você nos indicar e se inscreverá em qualquer um de nossos pacotes profissionais.', 'Guadagna fino a ${amount} per ogni utente che ci presenti e ti abbonarai a uno qualsiasi dei nostri pacchetti pro.', 'برای هر کاربری که به ما مراجعه می کنید تا {amount} دلار درآمد کسب کنید و در هر یک از بسته های حرفه ای ما مشترک شوید.', 'Tjäna upp till ${amount} för varje användare du hänvisar till oss och kommer att prenumerera på något av våra proffspaket.', 'Kiếm tới ${amount} cho mỗi người dùng mà bạn giới thiệu cho chúng tôi và sẽ đăng ký bất kỳ gói chuyên nghiệp nào của chúng tôi.', 'Tjen op til ${amount} for hver bruger, du henviser til os, og vil abonnere på enhver af vores pro-pakker.', 'Makakuha ng hanggang ${amount} para sa bawat user na iyong tinutukoy sa amin at magsu-subscribe sa alinman sa aming mga pro package.'),
