(886, 'earn_money_when_new_user', '', 'Earn money when a new user is registered to our website.', 'كسب المال عندما يتم تسجيل مستخدم جديد على موقعنا.', 'Verdien geld wanneer een nieuwe gebruiker zich op onze website registreert.', 'Gagnez de l&#39;argent lorsqu&#39;un nouvel utilisateur s&#39;inscrit sur notre site Web.', 'Verdienen Sie Geld, wenn ein neuer Benutzer auf unserer Website registriert wird.', 'Зарабатывайте деньги, когда новый пользователь регистрируется на нашем сайте.', 'Gane dinero cuando un nuevo usuario se registre en nuestro sitio web.', 'Web sitemize yeni bir kullanıcı kaydolduğunda para kazanın.', 'पैसा कमाएँ जब एक नया उपयोगकर्ता हमारी वेबसाइट पर पंजीकृत हो।', '当新用户注册到我们的网站时赚钱。', 'جب کوئی نیا صارف ہماری ویب سائٹ پر رجسٹرڈ ہوتا ہے تو پیسے کمائیں۔', 'Hasilkan uang saat pengguna baru terdaftar di situs web kami.', 'Zaradite novac kada se novi korisnik registrira na našoj web stranici.', 'הרוויח כסף כאשר משתמש חדש נרשם לאתר שלנו.', 'একজন নতুন ব্যবহারকারী আমাদের ওয়েবসাইটে নিবন্ধিত হলে অর্থ উপার্জন করুন।', '新規ユーザーが当社の Web サイトに登録すると、お金を獲得できます。', 'Ganhe dinheiro quando um novo usuário é registrado em nosso site.', 'Guadagna quando un nuovo utente si registra sul nostro sito web.', 'زمانی که کاربر جدیدی در وب سایت ما ثبت نام کردید، کسب درآمد کنید.', 'Tjäna pengar när en ny användare registreras på vår webbplats.', 'Kiếm tiền khi người dùng mới đăng ký vào trang web của chúng tôi.', 'Tjen penge, når en ny bruger er registreret på vores hjemmeside.', 'Kumita ng pera kapag may bagong user na nakarehistro sa aming website.'),
(887, 'earn_money_when_new_user_pro', '', 'Earn money when a new user is registred in our website & bought a pro package.', 'اربح المال عندما يتم تسجيل مستخدم جديد في موقعنا على الإنترنت واشترى حزمة احترافية.', 'Verdien geld wanneer een nieuwe gebruiker zich op onze website heeft geregistreerd en een pro-pakket heeft gekocht.', 'Gagnez de l&#39;argent lorsqu&#39;un nouvel utilisateur s&#39;inscrit sur notre site Web et achète un forfait pro.', 'Verdienen Sie Geld, wenn ein neuer Benutzer auf unserer Website registriert und ein Pro-Paket gekauft wird.', 'Зарабатывайте деньги, когда новый пользователь регистрируется на нашем сайте и покупает профессиональный пакет.', 'Gane dinero cuando un nuevo usuario se registre en nuestro sitio web y compre un paquete profesional.', 'Web sitemize yeni bir kullanıcı kaydolduğunda ve bir profesyonel paket satın aldığında para kazanın.', 'पैसे कमाएँ जब एक नया उपयोगकर्ता हमारी वेबसाइट में पंजीकृत हो और एक प्रो पैकेज खरीदा हो।', '当新用户在我们的网站上注册并购买专业套餐时即可赚钱。', 'جب کوئی نیا صارف ہماری ویب سائٹ پر رجسٹرڈ ہو اور پرو پیکج خریدے تو پیسے کمائیں۔', 'Hasilkan uang saat pengguna baru terdaftar di situs web kami &amp; membeli paket pro.', 'Zaradite novac kada se novi korisnik registrira na našoj web stranici i kupi pro paket.', 'הרוויח כסף כאשר משתמש חדש נרשם באתר שלנו וקנה חבילת מקצוענים.', 'যখন একজন নতুন ব্যবহারকারী আমাদের ওয়েবসাইটে নিবন্ধিত হন এবং একটি প্রো প্যাকেজ কিনেন তখন অর্থ উপার্জন করুন৷', '新しいユーザーが当社の Web サイトに登録され、プロ パッケージを購入すると、お金を獲得できます。', 'Ganhe dinheiro quando um novo usuário for registrado em nosso site e comprar um pacote profissional.', 'Guadagna quando un nuovo utente si registra nel nostro sito Web e acquista un pacchetto pro.', 'زمانی که یک کاربر جدید در وب سایت ما ثبت نام کرد و یک بسته حرفه ای خریداری کرد، درآمد کسب کنید.', 'Tjäna pengar när en ny användare är registrerad på vår webbplats och köpt ett proffspaket.', 'Kiếm tiền khi người dùng mới được đăng ký trên trang web của chúng tôi và mua gói chuyên nghiệp.', 'Tjen penge, når en ny bruger er registreret på vores hjemmeside og har købt en pro-pakke.', 'Kumita ng pera kapag may bagong user na nakarehistro sa aming website at bumili ng pro package.'),
(888, 'earn_money_when_new_user_subscribe', '', 'Earn money when a new user is registred in our website & subscrubed to any paid channel.', 'كسب المال عندما يتم تسجيل مستخدم جديد في موقعنا على شبكة الإنترنت واشتراكه في أي قناة مدفوعة.', 'Verdien geld wanneer een nieuwe gebruiker zich op onze website registreert en zich abonneert op een betaald kanaal.', 'Gagnez de l&#39;argent lorsqu&#39;un nouvel utilisateur est enregistré sur notre site Web et s&#39;abonne à n&#39;importe quel canal payant.', 'Verdienen Sie Geld, wenn ein neuer Benutzer auf unserer Website registriert und einen kostenpflichtigen Kanal abonniert wird.', 'Зарабатывайте деньги, когда новый пользователь регистрируется на нашем сайте и подписывается на любой платный канал.', 'Gane dinero cuando un nuevo usuario se registre en nuestro sitio web y se suscriba a cualquier canal pago.', 'Web sitemize yeni bir kullanıcı kaydolduğunda ve herhangi bir ücretli kanala abone olduğunda para kazanın.', 'जब कोई नया उपयोगकर्ता हमारी वेबसाइट पर पंजीकृत होता है और किसी भी भुगतान किए गए चैनल की सदस्यता लेता है तो पैसे कमाएँ।', '当新用户在我们的网站上注册并订阅任何付费频道时即可赚钱。', 'جب کوئی نیا صارف ہماری ویب سائٹ پر رجسٹرڈ ہو اور کسی بھی بامعاوضہ چینل کو سبسکرائب کرتا ہو تو پیسے کمائیں۔', 'Hasilkan uang saat pengguna baru terdaftar di situs web kami &amp; berlangganan saluran berbayar mana pun.', 'Zaradite novac kada se novi korisnik registrira na našoj web stranici i pretplati na bilo koji plaćeni kanal.', 'הרוויח כסף כאשר משתמש חדש נרשם באתר שלנו ונרשם לכל ערוץ בתשלום.', 'যখন একজন নতুন ব্যবহারকারী আমাদের ওয়েবসাইটে নিবন্ধিত হন এবং যেকোন অর্থপ্রদানের চ্যানেলে সাবস্ক্রাইব করেন তখন অর্থ উপার্জন করুন।', '新しいユーザーが当社のウェブサイトに登録され、有料チャンネルにサブスクライブされると、お金を獲得できます。', 'Ganhe dinheiro quando um novo usuário for registrado em nosso site e inscrito em qualquer canal pago.', 'Guadagna denaro quando un nuovo utente si registra nel nostro sito Web e si iscrive a qualsiasi canale a pagamento.', 'با ثبت نام کاربر جدید در وب سایت ما و عضویت در هر کانال پولی، درآمد کسب کنید.', 'Tjäna pengar när en ny användare är registrerad på vår webbplats och prenumererar på valfri betalkanal.', 'Kiếm tiền khi người dùng mới được đăng ký trên trang web của chúng tôi và được đăng ký theo bất kỳ kênh trả phí nào.', 'Tjen penge, når en ny bruger er registreret på vores hjemmeside og abonnerer på en hvilken som helst betalingskanal.', 'Kumita ng pera kapag may bagong user na nakarehistro sa aming website at nag-subscribe sa anumang bayad na channel.'),
