(893, 'requires_subscription', '', 'subscription is required to watch this video.', 'مطلوب الاشتراك لمشاهدة هذا الفيديو.', 'abonnement is vereist om deze video te bekijken.', 'un abonnement est nécessaire pour regarder cette vidéo.', 'Zum Ansehen dieses Videos ist ein Abonnement erforderlich.', 'для просмотра этого видео необходима подписка.', 'Se requiere suscripción para ver este video.', 'Bu videoyu izlemek için üyelik gereklidir.', 'इस वीडियो को देखने के लिए सदस्यता आवश्यक है।', '观看此视频需要订阅。', 'اس ویڈیو کو دیکھنے کے لیے سبسکرپشن درکار ہے۔', 'berlangganan diperlukan untuk menonton video ini.', 'za gledanje ovog videa potrebna je pretplata.', 'נדרש מנוי כדי לצפות בסרטון זה.', 'এই ভিডিওটি দেখার জন্য সদস্যতা প্রয়োজন।', 'このビデオを視聴するにはサブスクリプションが必要です。', 'é necessária uma assinatura para assistir a este vídeo.', 'per guardare questo video è necessario l&#39;abbonamento.', 'اشتراک برای تماشای این ویدئو الزامی است.', 'prenumeration krävs för att se den här videon.', 'đăng ký là cần thiết để xem video này.', 'abonnement er påkrævet for at se denne video.', 'kailangan ng subscription para mapanood ang video na ito.'),
(894, 'earn_users_subscribe', '', 'Earn up to {amount} for each user your refer to to our wbsite & will subscrube to any paid channel.', 'اكسب ما يصل إلى {amount} عن كل مستخدم تقوم بإحالته إلى موقع wbsite الخاص بنا وسوف تشترك في أي قناة مدفوعة.', 'Verdien tot {amount} voor elke gebruiker die je naar onze website verwijst en abonneer je op elk betaald kanaal.', 'Gagnez jusqu&#39;à {montant} pour chaque utilisateur que vous référez à notre site Web et abonnez-vous à n&#39;importe quelle chaîne payante.', 'Verdienen Sie bis zu {amount} für jeden Benutzer, den Sie auf unsere Website verweisen, und abonnieren Sie jeden kostenpflichtigen Kanal.', 'Зарабатывайте до {amount} за каждого пользователя, на которого вы ссылаетесь на наш веб-сайт и который подпишется на любой платный канал.', 'Gane hasta {cantidad} por cada usuario al que se refiera a nuestro sitio web y se suscriba a cualquier canal pago.', 'Web sitemize yönlendirdiğiniz her kullanıcı için {amount}&#39;a kadar kazanın ve herhangi bir ücretli kanala abone olun.', 'प्रत्येक उपयोगकर्ता के लिए {राशि} तक कमाएँ, जिसे आप हमारी वेबसाइट पर संदर्भित करते हैं और किसी भी भुगतान किए गए चैनल की सदस्यता लेंगे।', '为您引用我们网站的每个用户赚取高达 {amount} 并将订阅任何付费频道。', 'ہماری ویب سائٹ سے رجوع کرنے والے ہر صارف کے لیے {amount} تک کمائیں اور کسی بھی بامعاوضہ چینل کو سبسکرائب کریں گے۔', 'Hasilkan hingga {amount} untuk setiap pengguna yang Anda referensikan ke situs web kami &amp; akan berlangganan ke saluran berbayar mana pun.', 'Zaradite do {amount} za svakog korisnika kojeg uputite na našu web stranicu i pretplatit ćete se na bilo koji plaćeni kanal.', 'הרווח עד {amount} עבור כל משתמש שאתה מפנה אליו באתר האינטרנט שלנו ותעשה מנוי לכל ערוץ בתשלום.', 'আমাদের wbsite-এ আপনার উল্লেখ করা প্রতিটি ব্যবহারকারীর জন্য {amount} পর্যন্ত উপার্জন করুন এবং যেকোনো অর্থপ্রদানের চ্যানেলে সদস্যতা নেবেন।', 'あなたが私たちのウェブサイトを参照し、有料チャンネルにサブスクライブするユーザーごとに最大 {amount} を獲得します。', 'Ganhe até {amount} para cada usuário que você indicar ao nosso wbsite e se inscreverá em qualquer canal pago.', 'Guadagna fino a {amount} per ogni utente a cui fai riferimento al nostro sito Web e si iscriverà a qualsiasi canale a pagamento.', 'برای هر کاربری که به وب سایت ما مراجعه می کنید تا {amount} درآمد کسب کنید و در هر کانال پولی عضو شوید.', 'Tjäna upp till {amount} för varje användare du hänvisar till på vår wbsite och prenumererar på valfri betalkanal.', 'Kiếm tới {amount} cho mỗi người dùng mà bạn giới thiệu đến wbsite của chúng tôi và sẽ đăng ký theo bất kỳ kênh trả phí nào.', 'Tjen op til {amount} for hver bruger, du henviser til på vores wbsite, og vil abonnere på enhver betalingskanal.', 'Kumita ng hanggang {amount} para sa bawat user na iyong tinutukoy sa aming wbsite at magsu-subscrube sa anumang bayad na channel.');
