(895, 'earn_users_buy_rent', '', 'Earn up to {amount} for each user your refer to our website & will purchase or rent a video/movie.', 'اكسب ما يصل إلى {amount} عن كل مستخدم تقوم بإحالته إلى موقعنا على الويب وسوف يشتري أو يستأجر فيديو / فيلم.', 'Verdien tot {amount} voor elke gebruiker die u naar onze website verwijst en een video/film koopt of huurt.', 'Gagnez jusqu&#39;à {montant} pour chaque utilisateur que vous parrainez sur notre site Web et achèterez ou louerez une vidéo/un film.', 'Verdienen Sie bis zu {amount} für jeden Nutzer, den Sie auf unsere Website verweisen und ein Video/einen Film kaufen oder ausleihen.', 'Зарабатывайте до {amount} за каждого пользователя, который перешел на наш сайт и купит или возьмет напрокат видео/фильм.', 'Gane hasta {cantidad} por cada usuario que refiera a nuestro sitio web y compre o alquile un video o una película.', 'Web sitemize yönlendirdiğiniz ve bir video/film satın alacak veya kiralayacak her kullanıcı için {amount}&#39;a kadar kazanın.', 'प्रत्येक उपयोगकर्ता के लिए {राशि} तक कमाएँ जो आप हमारी वेबसाइट को संदर्भित करते हैं और एक वीडियो/मूवी खरीदेंगे या किराए पर लेंगे।', '为您推荐我们的网站并将购买或租借视频/电影的每位用户赚取高达 {amount}。', 'ہماری ویب سائٹ سے رجوع کرنے والے ہر صارف کے لیے {amount} تک کمائیں اور ایک ویڈیو/مووی خریدیں گے یا کرایہ پر لیں گے۔', 'Hasilkan hingga {amount} untuk setiap pengguna yang Anda referensikan ke situs web kami &amp; akan membeli atau menyewa video/film.', 'Zaradite do {amount} za svakog korisnika kojeg posjetite našu web stranicu i kupi ili iznajmi video/film.', 'הרווח עד {amount} עבור כל משתמש שתפנה לאתר שלנו וירכוש או ישכור סרטון/סרט.', 'আমাদের ওয়েবসাইটে আপনি যে ব্যবহারকারীকে রেফার করেন তার জন্য {amount} পর্যন্ত উপার্জন করুন এবং একটি ভিডিও/মুভি কিনবেন বা ভাড়া দেবেন।', 'あなたが私たちのウェブサイトを参照し、ビデオ/映画を購入またはレンタルするユーザーごとに最大 {amount} を獲得できます。', 'Ganhe até {amount} para cada usuário que você indicar ao nosso site e compre ou alugue um vídeo/filme.', 'Guadagna fino a {amount} per ogni utente che indirizzi al nostro sito Web e acquisterà o noleggerà un video/film.', 'برای هر کاربری که به وب‌سایت ما مراجعه می‌کنید و یک ویدیو/فیلم را خریداری یا اجاره می‌کنید، حداکثر {مبلغ} درآمد کسب کنید.', 'Tjäna upp till {amount} för varje användare du hänvisar till vår webbplats och kommer att köpa eller hyra en video/film.', 'Kiếm tới {amount} cho mỗi người dùng mà bạn giới thiệu đến trang web của chúng tôi và sẽ mua hoặc thuê video/phim.', 'Tjen op til {amount} for hver bruger, du henviser til vores hjemmeside, og vil købe eller leje en video/film.', 'Kumita ng hanggang {amount} para sa bawat user na sumangguni ka sa aming website at bibili o magrenta ng video/pelikula.'),
