(966, 'authenticator_download', '', 'Download the app: You can download Google Authenticator from the App Store (for iPhone) or the Google Play Store (for Android).', 'تنزيل التطبيق: يمكنك تنزيل Google Authenticator من App Store (لأجهزة iPhone) أو متجر Google Play (لنظام Android).', 'Download de app: U kunt Google Authenticator downloaden via de App Store (voor iPhone) of de Google Play Store (voor Android).', 'Téléchargez l&#39;application : Vous pouvez télécharger Google Authenticator depuis l&#39;App Store (pour iPhone) ou le Google Play Store (pour Android).', 'Laden Sie die App herunter: Sie können Google Authenticator aus dem App Store (für iPhone) oder dem Google Play Store (für Android) herunterladen.', 'Загрузите приложение: вы можете загрузить Google Authenticator из App Store (для iPhone) или Google Play Store (для Android).', 'Descarga la aplicación: puedes descargar Google Authenticator desde App Store (para iPhone) o Google Play Store (para Android).', 'Uygulamayı indirin: Google Authenticator&#39;ı App Store&#39;dan (iPhone için) veya Google Play Store&#39;dan (Android için) indirebilirsiniz.', 'ऐप डाउनलोड करें: आप Google प्रमाणक को ऐप स्टोर (iPhone के लिए) या Google Play Store (Android के लिए) से डाउनलोड कर सकते हैं।', '下载应用程序：您可以从 App Store（适用于 iPhone）或 Google Play Store（适用于 Android）下载 Google Authenticator。', 'ایپ ڈاؤن لوڈ کریں: آپ ایپ اسٹور (آئی فون کے لیے) یا گوگل پلے اسٹور (اینڈرائیڈ کے لیے) سے Google Authenticator ڈاؤن لوڈ کرسکتے ہیں۔', 'Unduh aplikasi: Anda dapat mengunduh Google Authenticator dari App Store (untuk iPhone) atau Google Play Store (untuk Android).', 'Preuzmite aplikaciju: Google Authenticator možete preuzeti iz App Store (za iPhone) ili Google Play Store (za Android).', 'הורדת האפליקציה: ניתן להוריד את Google Authenticator מחנות האפליקציות (לאייפון) או מחנות Google Play (לאנדרואיד).', 'অ্যাপটি ডাউনলোড করুন: আপনি অ্যাপ স্টোর (আইফোনের জন্য) বা গুগল প্লে স্টোর (অ্যান্ড্রয়েডের জন্য) থেকে Google প্রমাণীকরণকারী ডাউনলোড করতে পারেন।', 'アプリをダウンロードする: Google 認証システムは、App Store (iPhone の場合) または Google Play ストア (Android の場合) からダウンロードできます。', 'Baixe o aplicativo: Você pode baixar o Google Authenticator na App Store (para iPhone) ou na Google Play Store (para Android).', 'Scarica l&#39;app: puoi scaricare Google Authenticator dall&#39;App Store (per iPhone) o da Google Play Store (per Android).', 'دانلود برنامه: می توانید Google Authenticator را از اپ استور (برای آیفون) یا گوگل پلی استور (برای اندروید) دانلود کنید.', 'Ladda ner appen: Du kan ladda ner Google Authenticator från App Store (för iPhone) eller Google Play Store (för Android).', 'Tải ứng dụng: Bạn có thể tải Google Authenticator từ App Store (dành cho iPhone) hoặc Google Play Store (dành cho Android).', 'Download appen: Du kan downloade Google Authenticator fra App Store (til iPhone) eller Google Play Store (til Android).', 'I-download ang app: Maaari mong i-download ang Google Authenticator mula sa App Store (para sa iPhone) o sa Google Play Store (para sa Android).'),
(967, 'authenticator_set', '', 'Set up an account: To set up an account with Google Authenticator and scan the QR code provided with the Google Authenticator app.', 'إعداد حساب: لإعداد حساب باستخدام Google Authenticator ومسح رمز QR المقدم مع تطبيق Google Authenticator.', 'Een account instellen: om een account met Google Authenticator in te stellen en de QR-code te scannen die bij de Google Authenticator-app is geleverd.', 'Configurer un compte : Pour configurer un compte avec Google Authenticator et scanner le code QR fourni avec l&#39;application Google Authenticator.', 'Konto einrichten: So richten Sie ein Konto bei Google Authenticator ein und scannen Sie den mit der Google Authenticator-App bereitgestellten QR-Code.', 'Настроить учетную запись: настроить учетную запись с помощью Google Authenticator и отсканировать QR-код, предоставленный с приложением Google Authenticator.', 'Configurar una cuenta: para configurar una cuenta con Google Authenticator y escanear el código QR proporcionado con la aplicación Google Authenticator.', 'Bir hesap oluşturun: Google Authenticator ile bir hesap oluşturmak ve Google Authenticator uygulamasıyla sağlanan QR kodunu taramak için.', 'एक खाता सेट करें: Google प्रमाणक के साथ एक खाता स्थापित करने और Google प्रमाणक ऐप के साथ प्रदान किए गए क्यूआर कोड को स्कैन करने के लिए।', '设置账户：使用谷歌验证器设置账户，扫描谷歌验证器应用程序提供的二维码。', 'ایک اکاؤنٹ ترتیب دیں: Google Authenticator کے ساتھ اکاؤنٹ قائم کرنے اور Google Authenticator ایپ کے ساتھ فراہم کردہ QR کوڈ کو اسکین کرنے کے لیے۔', 'Siapkan akun: Untuk menyiapkan akun dengan Google Authenticator dan memindai kode QR yang disediakan dengan aplikasi Google Authenticator.', 'Postavite račun: Za postavljanje računa s Google Authenticatorom i skenirajte QR kod koji ste dobili uz aplikaciju Google Authenticator.', 'הגדר חשבון: כדי להגדיר חשבון עם Google Authenticator ולסרוק את קוד ה-QR שסופק עם אפליקציית Google Authenticator.', 'একটি অ্যাকাউন্ট সেট আপ করুন: Google প্রমাণীকরণকারীর সাথে একটি অ্যাকাউন্ট সেট আপ করতে এবং Google প্রমাণীকরণকারী অ্যাপের সাথে প্রদত্ত QR কোড স্ক্যান করুন।', 'アカウントのセットアップ: Google Authenticator でアカウントをセットアップし、Google Authenticator アプリで提供される QR コードをスキャンします。', 'Configurar uma conta: Para configurar uma conta com o Google Authenticator e digitalizar o código QR fornecido com o aplicativo Google Authenticator.', 'Configura un account: per configurare un account con Google Authenticator e scansionare il codice QR fornito con l&#39;app Google Authenticator.', 'راه اندازی حساب: برای راه اندازی یک حساب با Google Authenticator و اسکن کد QR ارائه شده با برنامه Google Authenticator.', 'Skapa ett konto: För att skapa ett konto med Google Authenticator och skanna QR-koden som medföljer Google Authenticator-appen.', 'Thiết lập tài khoản: Để thiết lập tài khoản với Google Authenticator và quét mã QR được cung cấp cùng với ứng dụng Google Authenticator.', 'Opret en konto: For at oprette en konto med Google Authenticator og scanne QR-koden, der følger med Google Authenticator-appen.', 'Mag-set up ng account: Upang mag-set up ng account sa Google Authenticator at i-scan ang QR code na ibinigay kasama ng Google Authenticator app.'),
(968, 'authenticator_verify', '', 'Verify your account: After you\'ve set up your account, you\'ll be asked to enter a Confirmation Code (OTP) generated by Google Authenticator to verify your account. Simply open the app, find the account you set up, and enter the OTP when prompted.', 'التحقق من حسابك: بعد إعداد حسابك ، سيُطلب منك إدخال رمز تأكيد (OTP) تم إنشاؤه بواسطة Google Authenticator للتحقق من حسابك. ما عليك سوى فتح التطبيق ، والعثور على الحساب الذي قمت بإعداده ، وإدخال كلمة المرور لمرة واحدة عندما يُطلب منك ذلك.', 'Verifieer uw account: nadat u uw account heeft ingesteld, wordt u gevraagd een bevestigingscode (OTP) in te voeren die is gegenereerd door Google Authenticator om uw account te verifiëren. Open gewoon de app, zoek het account dat u hebt ingesteld en voer de OTP in wanneer daarom wordt gevraagd.', 'Vérifiez votre compte : après avoir configuré votre compte, vous serez invité à saisir un code de confirmation (OTP) généré par Google Authenticator pour vérifier votre compte. Ouvrez simplement l&#39;application, recherchez le compte que vous avez configuré et entrez l&#39;OTP lorsque vous y êtes invité.', 'Verifizieren Sie Ihr Konto: Nachdem Sie Ihr Konto eingerichtet haben, werden Sie aufgefordert, einen von Google Authenticator generierten Bestätigungscode (OTP) einzugeben, um Ihr Konto zu verifizieren. Öffnen Sie einfach die App, suchen Sie das von Ihnen eingerichtete Konto und geben Sie das OTP ein, wenn Sie dazu aufgefordert werden.', 'Подтвердите свою учетную запись: после того, как вы настроили свою учетную запись, вам будет предложено ввести код подтверждения (OTP), сгенерированный Google Authenticator, для проверки вашей учетной записи. Просто откройте приложение, найдите созданную вами учетную запись и введите одноразовый пароль при появлении запроса.', 'Verifique su cuenta: después de configurar su cuenta, se le pedirá que ingrese un Código de confirmación (OTP) generado por Google Authenticator para verificar su cuenta. Simplemente abra la aplicación, busque la cuenta que configuró e ingrese la OTP cuando se le solicite.', 'Hesabınızı doğrulayın: Hesabınızı kurduktan sonra, hesabınızı doğrulamak için Google Authenticator tarafından oluşturulan bir Onay Kodu (OTP) girmeniz istenecektir. Uygulamayı açın, kurduğunuz hesabı bulun ve istendiğinde OTP&#39;yi girin.', 'अपना खाता सत्यापित करें: आपके द्वारा अपना खाता सेट करने के बाद, आपको अपना खाता सत्यापित करने के लिए Google प्रमाणक द्वारा उत्पन्न एक पुष्टिकरण कोड (OTP) दर्ज करने के लिए कहा जाएगा। बस ऐप खोलें, आपके द्वारा सेट किए गए खाते को ढूंढें और संकेत दिए जाने पर ओटीपी दर्ज करें।', '验证您的帐户：设置帐户后，系统会要求您输入由 Google Authenticator 生成的确认码 (OTP) 以验证您的帐户。只需打开应用程序，找到您设置的帐户，然后在出现提示时输入 OTP。', 'اپنے اکاؤنٹ کی تصدیق کریں: اپنے اکاؤنٹ کو ترتیب دینے کے بعد، آپ سے اپنے اکاؤنٹ کی تصدیق کے لیے Google Authenticator کے ذریعے تیار کردہ تصدیقی کوڈ (OTP) درج کرنے کے لیے کہا جائے گا۔ بس ایپ کھولیں، اپنا سیٹ کردہ اکاؤنٹ تلاش کریں، اور اشارہ کرنے پر OTP درج کریں۔', 'Verifikasi akun Anda: Setelah menyiapkan akun, Anda akan diminta untuk memasukkan Kode Konfirmasi (OTP) yang dibuat oleh Google Authenticator untuk memverifikasi akun Anda. Cukup buka aplikasi, temukan akun yang Anda atur, dan masukkan OTP saat diminta.', 'Potvrdite svoj račun: nakon što postavite svoj račun, od vas će se tražiti da unesete potvrdni kod (OTP) koji je generirao Google Authenticator kako biste potvrdili svoj račun. Jednostavno otvorite aplikaciju, pronađite račun koji ste postavili i unesite OTP kada se to od vas zatraži.', 'אמת את חשבונך: לאחר הגדרת חשבונך, תתבקש להזין קוד אישור (OTP) שנוצר על ידי Google Authenticator כדי לאמת את חשבונך. פשוט פתח את האפליקציה, מצא את החשבון שהגדרת והזן את ה-OTP כשתתבקש.', 'আপনার অ্যাকাউন্ট যাচাই করুন: আপনি আপনার অ্যাকাউন্ট সেট আপ করার পরে, আপনাকে আপনার অ্যাকাউন্ট যাচাই করার জন্য Google প্রমাণীকরণকারী দ্বারা তৈরি একটি নিশ্চিতকরণ কোড (OTP) লিখতে বলা হবে। কেবল অ্যাপটি খুলুন, আপনার সেট আপ করা অ্যাকাউন্টটি খুঁজুন এবং অনুরোধ করা হলে OTP লিখুন।', 'アカウントの確認: アカウントの設定が完了すると、アカウントを確認するために Google Authenticator によって生成された確認コード (OTP) を入力するよう求められます。アプリを開いて設定したアカウントを見つけ、プロンプトが表示されたら OTP を入力するだけです。', 'Verifique sua conta: depois de configurar sua conta, você será solicitado a inserir um código de confirmação (OTP) gerado pelo Google Authenticator para verificar sua conta. Basta abrir o aplicativo, encontrar a conta que você configurou e inserir o OTP quando solicitado.', 'Verifica il tuo account: dopo aver configurato il tuo account, ti verrà chiesto di inserire un codice di conferma (OTP) generato da Google Authenticator per verificare il tuo account. Apri semplicemente l&#39;app, trova l&#39;account che hai configurato e inserisci l&#39;OTP quando richiesto.', 'حساب خود را تأیید کنید: پس از راه‌اندازی حساب خود، از شما خواسته می‌شود یک کد تأیید (OTP) ایجاد شده توسط Google Authenticator را برای تأیید حساب خود وارد کنید. به سادگی برنامه را باز کنید، حسابی را که راه‌اندازی کرده‌اید پیدا کنید و وقتی از شما خواسته شد، OTP را وارد کنید.', 'Verifiera ditt konto: När du har konfigurerat ditt konto kommer du att bli ombedd att ange en bekräftelsekod (OTP) genererad av Google Authenticator för att verifiera ditt konto. Öppna helt enkelt appen, hitta kontot du konfigurerade och ange OTP när du uppmanas.', 'Xác minh tài khoản của bạn: Sau khi thiết lập tài khoản, bạn sẽ được yêu cầu nhập Mã xác nhận (OTP) do Google Authenticator tạo để xác minh tài khoản của mình. Chỉ cần mở ứng dụng, tìm tài khoản bạn đã thiết lập và nhập OTP khi được nhắc.', 'Bekræft din konto: Når du har konfigureret din konto, bliver du bedt om at indtaste en bekræftelseskode (OTP) genereret af Google Authenticator for at bekræfte din konto. Du skal blot åbne appen, finde den konto, du har oprettet, og indtaste OTP, når du bliver bedt om det.', 'I-verify ang iyong account: Pagkatapos mong i-set up ang iyong account, hihilingin sa iyong maglagay ng Confirmation Code (OTP) na binuo ng Google Authenticator upang i-verify ang iyong account. Buksan lang ang app, hanapin ang account na iyong na-set up, at ilagay ang OTP kapag na-prompt.'),
(969, 'authenticator_otp', '', 'Use the OTP: Whenever you sign in to your account, you\'ll be asked for both your password and an OTP generated by Google Authenticator. Simply open the app, find the account you set up, and enter the OTP when prompted.', 'استخدام كلمة المرور لمرة واحدة: عندما تقوم بتسجيل الدخول إلى حسابك ، ستتم مطالبتك بكل من كلمة المرور وكلمة المرور لمرة واحدة التي تم إنشاؤها بواسطة Google Authenticator. ما عليك سوى فتح التطبيق ، والعثور على الحساب الذي قمت بإعداده ، وإدخال كلمة المرور لمرة واحدة عندما يُطلب منك ذلك.', 'Gebruik de OTP: Telkens wanneer u zich aanmeldt bij uw account, wordt u gevraagd om zowel uw wachtwoord als een OTP gegenereerd door Google Authenticator. Open gewoon de app, zoek het account dat u hebt ingesteld en voer de OTP in wanneer daarom wordt gevraagd.', 'Utilisez l&#39;OTP : chaque fois que vous vous connectez à votre compte, votre mot de passe et un OTP généré par Google Authenticator vous seront demandés. Ouvrez simplement l&#39;application, recherchez le compte que vous avez configuré et entrez l&#39;OTP lorsque vous y êtes invité.', 'OTP verwenden: Jedes Mal, wenn Sie sich bei Ihrem Konto anmelden, werden Sie sowohl nach Ihrem Passwort als auch nach einem von Google Authenticator generierten OTP gefragt. Öffnen Sie einfach die App, suchen Sie das von Ihnen eingerichtete Konto und geben Sie das OTP ein, wenn Sie dazu aufgefordert werden.', 'Используйте одноразовый пароль: всякий раз, когда вы входите в свою учетную запись, вам будет предложено ввести пароль и одноразовый пароль, сгенерированный Google Authenticator. Просто откройте приложение, найдите созданную вами учетную запись и введите одноразовый пароль при появлении запроса.', 'Use la OTP: cada vez que inicie sesión en su cuenta, se le pedirá su contraseña y una OTP generada por Google Authenticator. Simplemente abra la aplicación, busque la cuenta que configuró e ingrese la OTP cuando se le solicite.', 'OTP&#39;yi kullanın: Hesabınızda her oturum açtığınızda, sizden hem şifreniz hem de Google Authenticator tarafından oluşturulan bir OTP istenecektir. Uygulamayı açın, kurduğunuz hesabı bulun ve istendiğinde OTP&#39;yi girin.', 'ओटीपी का उपयोग करें: जब भी आप अपने खाते में साइन इन करते हैं, तो आपसे आपका पासवर्ड और Google प्रमाणक द्वारा उत्पन्न ओटीपी दोनों के लिए कहा जाएगा। बस ऐप खोलें, आपके द्वारा सेट किए गए खाते को ढूंढें और संकेत दिए जाने पर ओटीपी दर्ज करें।', '使用 OTP：每当您登录帐户时，系统都会要求您提供密码和由 Google 身份验证器生成的 OTP。只需打开应用程序，找到您设置的帐户，然后在出现提示时输入 OTP。', 'OTP استعمال کریں: جب بھی آپ اپنے اکاؤنٹ میں سائن ان کریں گے، آپ سے آپ کا پاس ورڈ اور Google Authenticator کے ذریعے تیار کردہ OTP دونوں کے لیے پوچھا جائے گا۔ بس ایپ کھولیں، اپنا سیٹ کردہ اکاؤنٹ تلاش کریں، اور اشارہ کرنے پر OTP درج کریں۔', 'Gunakan OTP: Setiap kali masuk ke akun, Anda akan dimintai kata sandi dan OTP yang dibuat oleh Google Authenticator. Cukup buka aplikasi, temukan akun yang Anda atur, dan masukkan OTP saat diminta.', 'Koristite OTP: Kad god se prijavite na svoj račun, od vas će se tražiti i vaša lozinka i OTP koji generira Google Authenticator. Jednostavno otvorite aplikaciju, pronađite račun koji ste postavili i unesite OTP kada se to od vas zatraži.', 'השתמש ב-OTP: בכל פעם שתיכנס לחשבון שלך, תתבקש להזין את הסיסמה שלך וגם OTP שנוצר על ידי Google Authenticator. פשוט פתח את האפליקציה, מצא את החשבון שהגדרת והזן את ה-OTP כשתתבקש.', 'ওটিপি ব্যবহার করুন: যখনই আপনি আপনার অ্যাকাউন্টে সাইন ইন করবেন, তখনই আপনাকে আপনার পাসওয়ার্ড এবং Google প্রমাণীকরণকারীর দ্বারা উত্পন্ন একটি ওটিপি উভয়ের জন্য জিজ্ঞাসা করা হবে৷ কেবল অ্যাপটি খুলুন, আপনার সেট আপ করা অ্যাকাউন্টটি খুঁজুন এবং অনুরোধ করা হলে OTP লিখুন।', 'OTP を使用する: アカウントにサインインするたびに、パスワードと、Google Authenticator によって生成された OTP の両方を求められます。アプリを開いて設定したアカウントを見つけ、プロンプトが表示されたら OTP を入力するだけです。', 'Use o OTP: Sempre que você fizer login em sua conta, será solicitado sua senha e um OTP gerado pelo Google Authenticator. Basta abrir o aplicativo, encontrar a conta que você configurou e inserir o OTP quando solicitado.', 'Utilizza l&#39;OTP: ogni volta che accedi al tuo account, ti verrà chiesta sia la password che un OTP generato da Google Authenticator. Apri semplicemente l&#39;app, trova l&#39;account che hai impostato e inserisci l&#39;OTP quando richiesto.', 'از OTP استفاده کنید: هر زمان که وارد حساب خود می شوید، هم رمز عبور و هم یک OTP تولید شده توسط Google Authenticator از شما خواسته می شود. به سادگی برنامه را باز کنید، حسابی را که راه‌اندازی کرده‌اید پیدا کنید و وقتی از شما خواسته شد، OTP را وارد کنید.', 'Använd OTP: När du loggar in på ditt konto kommer du att bli ombedd att ange både ditt lösenord och en OTP genererad av Google Authenticator. Öppna helt enkelt appen, hitta kontot du konfigurerade och ange OTP när du uppmanas.', 'Sử dụng OTP: Bất cứ khi nào bạn đăng nhập vào tài khoản của mình, bạn sẽ được yêu cầu cung cấp cả mật khẩu và OTP do Google Authenticator tạo. Chỉ cần mở ứng dụng, tìm tài khoản bạn đã thiết lập và nhập OTP khi được nhắc.', 'Brug OTP: Når du logger ind på din konto, bliver du bedt om både din adgangskode og en OTP genereret af Google Authenticator. Du skal blot åbne appen, finde den konto, du har oprettet, og indtaste OTP, når du bliver bedt om det.', 'Gamitin ang OTP: Sa tuwing magsa-sign in ka sa iyong account, hihilingin sa iyo ang iyong password at isang OTP na binuo ng Google Authenticator. Buksan lang ang app, hanapin ang account na iyong na-set up, at ilagay ang OTP kapag na-prompt.'),
