(978, 'explore_pro_desc', '', 'Your payment has been successful and you are now a Pro memeber with multiple benefits. You can start exploring Pro features now.', 'لقد نجحت عملية الدفع الخاصة بك وأنت الآن عضو محترف يتمتع بمزايا متعددة. يمكنك البدء في استكشاف ميزات Pro الآن.', 'Uw betaling is gelukt en u bent nu een Pro-lid met meerdere voordelen. U kunt nu beginnen met het verkennen van Pro-functies.', 'Votre paiement a été effectué avec succès et vous êtes maintenant un membre Pro avec de multiples avantages. Vous pouvez commencer à explorer les fonctionnalités Pro dès maintenant.', 'Ihre Zahlung war erfolgreich und Sie sind jetzt ein Pro-Mitglied mit zahlreichen Vorteilen. Sie können jetzt mit der Erkundung der Pro-Funktionen beginnen.', 'Ваш платеж прошел успешно, и теперь вы являетесь профессиональным участником со множеством преимуществ. Вы можете начать изучать функции Pro прямо сейчас.', 'Tu pago se ha realizado correctamente y ahora eres miembro Pro con múltiples beneficios. Puede comenzar a explorar las funciones Pro ahora.', 'Ödemeniz başarılı oldu ve artık birçok avantaja sahip bir Pro üyesisiniz. Şimdi Pro özelliklerini keşfetmeye başlayabilirsiniz.', 'आपका भुगतान सफल हो गया है और अब आप कई लाभों के साथ प्रो सदस्य हैं। अब आप प्रो फीचर्स एक्सप्लोर करना शुरू कर सकते हैं।', '您的付款已成功，您现在是拥有多项权益的专业会员。您现在可以开始探索 Pro 功能。', 'آپ کی ادائیگی کامیاب ہو گئی ہے اور اب آپ متعدد فوائد کے ساتھ ایک پرو ممبر ہیں۔ آپ ابھی پرو خصوصیات کو تلاش کرنا شروع کر سکتے ہیں۔', 'Pembayaran Anda telah berhasil dan Anda sekarang menjadi anggota Pro dengan banyak manfaat. Anda dapat mulai menjelajahi fitur Pro sekarang.', 'Vaša je uplata bila uspješna i sada ste Pro član s više pogodnosti. Sada možete početi istraživati Pro značajke.', 'התשלום שלך הצליח וכעת אתה חבר מקצוען עם מספר הטבות. אתה יכול להתחיל לחקור את תכונות ה-Pro עכשיו.', 'আপনার অর্থপ্রদান সফল হয়েছে এবং আপনি এখন একাধিক সুবিধা সহ একজন প্রো সদস্য। আপনি এখন প্রো বৈশিষ্ট্যগুলি অন্বেষণ শুরু করতে পারেন৷', 'お支払いが正常に完了し、複数の特典を利用できる Pro メンバーになりました。今すぐ Pro 機能の探索を開始できます。', 'Seu pagamento foi bem-sucedido e agora você é um membro Pro com vários benefícios. Você pode começar a explorar os recursos Pro agora.', 'Il tuo pagamento è andato a buon fine e ora sei un membro Pro con molteplici vantaggi. Puoi iniziare a esplorare le funzionalità Pro ora.', 'پرداخت شما با موفقیت انجام شد و اکنون یک عضو حرفه ای با مزایای متعدد هستید. اکنون می توانید کاوش ویژگی های Pro را شروع کنید.', 'Din betalning har lyckats och du är nu en Pro-medlem med flera förmåner. Du kan börja utforska Pro-funktioner nu.', 'Thanh toán của bạn đã thành công và bạn hiện là thành viên Pro với nhiều lợi ích. Bạn có thể bắt đầu khám phá các tính năng Pro ngay bây giờ.', 'Din betaling er lykkedes, og du er nu Pro-medlem med flere fordele. Du kan begynde at udforske Pro-funktioner nu.', 'Naging matagumpay ang iyong pagbabayad at isa ka na ngayong Pro memeber na may maraming benepisyo. Maaari mong simulan ang paggalugad ng mga feature ng Pro ngayon.'),
