(986, 'pro_package_short_text', '', 'it is a long established fact that a reader will be distracted.', 'إنها حقيقة مثبتة منذ زمن طويل وهي أن القارئ سوف يشتت انتباهه.', 'het is een lang vaststaand feit dat een lezer afgeleid zal worden.', 'c&#39;est un fait établi depuis longtemps qu&#39;un lecteur sera distrait.', 'Es ist eine seit langem bekannte Tatsache, dass ein Leser abgelenkt wird.', 'это давно установленный факт, что читатель будет отвлекаться.', 'es un hecho establecido desde hace mucho tiempo que un lector se distraerá.', 'bir okuyucunun dikkatinin dağılacağı uzun süredir bilinen bir gerçektir.', 'यह एक लंबे समय से स्थापित तथ्य है कि एक पाठक विचलित हो जाएगा।', '读者会分心是一个早已确定的事实。', 'یہ ایک طویل عرصے سے قائم حقیقت ہے کہ ایک قاری مشغول ہو جائے گا.', 'itu adalah fakta lama bahwa pembaca akan terganggu.', 'odavno je utvrđena činjenica da će čitatelj biti ometen.', 'עובדה ידועה זה מכבר שדעתו של הקורא יוסח.', 'এটি একটি দীর্ঘ প্রতিষ্ঠিত সত্য যে একটি পাঠক বিভ্রান্ত হবে.', '読者が気を散らすことは、長い間確立された事実です。', 'é um fato há muito estabelecido que o leitor se distrairá.', 'è un dato di fatto che un lettore sarà distratto.', 'این یک واقعیت ثابت شده است که خواننده حواسش پرت می شود.', 'det är ett sedan länge etablerat faktum att en läsare kommer att bli distraherad.', 'một thực tế đã được chứng minh từ lâu là người đọc sẽ bị phân tâm.', 'det er et længe fastslået faktum, at en læser vil blive distraheret.', 'ito ay isang matagal nang itinatag na katotohanan na ang isang mambabasa ay magambala.'),
